'A6','4—Extreme: pervasive disabling fear and/or avoidance. Extensive modification in my lifestyle was required, such that important tasks were not performed.',5,5,'en',0),(121,'A2','0—No fear or avoidance of situations or activities because of distressing physical sensations.',1,1,'en',0),(120,'A5','3—Severe: extensive avoidance. Substantial modification of my lifestyle was required to accommodate the avoidance, making it difficult to manage usual activities.',4,4,'en',0),(120,'A4','2—Moderate: noticeable fear and/or avoidance, but still manageable. I avoided some situations but I could confront them with a companion. There was some modification of my lifestyle because of this, but my overall functioning was not impaired.',3,3,'en',0),(120,'A2','0—None: no fear or avoidance.',1,1,'en',0),(120,'A3','1—Mild: occasional fear and/or avoidance, but I could usually confront or endure the situation. There was little or no modification of my lifestyle due to this.',2,2,'en',0),(119,'A6','4—Nearly constantly and to a disabling extent.',5,5,'en',0),(119,'A3','1—Occasionally or only mildly.',2,2,'en',0),(119,'A4','2—Frequently or moderately.',3,3,'en',0),(122,'A2','0—No interference with work or home responsibilities.',1,1,'en',0),(122,'A3','1—Slight interference with work or home responsibilities, but I could do nearly everything I could if I didn’t have these problems.',2,2,'en',0),(121,'A6','4—Extreme: pervasive and disabling avoidance. There was extensive modification in my lifestyle due to this, such that important tasks or activities were not performed.',5,5,'en',0),(121,'A5','3—Severe: extensive avoidance. There was substantial modification of my lifestyle or interference in my functioning. ',4,4,'en',0),(121,'A4','2—Moderate: noticeable avoidance, but still manageable. There was definite, but limited, modification of my lifestyle, such that my overall functioning was not impaired.',3,3,'en',0),(121,'A3','1—Mild: occasional fear and/or avoidance, but usually I could confront or endure with little distress activities that cause physical sensations. There was little modification of my lifestyle due to this.',2,2,'en',0),(124,'2','Minimal - Questionable pathology',2,0,'en',0),(124,'3','Mild - Presence of one or two delusions which are vague, uncrystallised and not tenaciously held. Delusions do not interfere with thinking, social relations or behaviour.',3,0,'en',0),(123,'A6','4—Extreme, incapacitating impairment, such that there was hardly anything social I could do. ',5,5,'en',0),(123,'A5','3—Substantial impairment in social activities; there are many social things I couldn’t do because of these problems.',4,4,'en',0),(123,'A4','2—Significant interference with social activities, but I could manage to do most things if I made the effort.',3,3,'en',0),(123,'A2','0—No interference. ',1,1,'en',0),(123,'A3','1—Slight interference with social activities, but I could do nearly everything I could if I didn’t have these problems.',2,2,'en',0),(122,'A6','4—Extreme, incapacitating impairment, such that I was essentially unable to manage any work or home responsibilities.',5,5,'en',0),(122,'A5','3—Substantial impairment in work or home responsibilities; there were many important things I couldn’t do because of these problems.',4,4,'en',0),(122,'A4','2—Significant interference with work or home responsibilities, but I still could manage to do the things I needed to do.',3,3,'en',0),(125,'1','Absent - Definition does not apply',1,0,'en',0),(125,'2','Minimal - Questionable pathology',2,0,'en',0),(125,'3','Mild - Thinking is circumstantial, tangential or paralogical. There is some difficulty in directing thoughts towards a goal, and some loosening of associations may be evidenced under pressure.',3,0,'en',0),(124,'7','Extreme - Presence of a stable set of delusions which are either highly systematised or very numerous, and which dominate major facets of the patient’s life. This frequently results in inappropriate and irresponsible action, which may even jeopardise the safety of the patient or others. ',7,0,'en',0),(124,'6','Severe - Presence of a stable set of delusions which are crystallised, possibly systematised, tenaciously held and clearly interfere with thinking, social relations and behaviour.',6,0,'en',0),(124,'5','Moderate Severe - Presence of numerous well-formed delusions that are tenaciously held and occasionally interfere with thinking, social relations and behaviour.',5,0,'en',0),(124,'4','Moderate - Presence of either a kaleidoscopic array of poorly formed, unstable delusions or a few well-formed delusions that occasionally interfere with thinking, social relations or behaviour.',4,0,'en',0),(130,'1','Absent - Definition does not apply',1,0,'en',0),(130,'2','Minimal - Questionable pathology',2,0,'en',0),(130,'3','Mild - Indirect or restrained communication of anger, such as sarcasm, disrespect, hostile expressions and occasional irritability.',3,0,'en',0),(125,'7','Extreme - Thoughts are disrupted to the point where the patient is incoherent. There is marked loosening of associations, which result in total failure of communication, e.g. “word salad” or mutism. ',7,0,'en',0),(125,'6','Severe - Thinking is seriously derailed and internally inconsistent, resulting in gross irrelevancies and disruption of thought processes, which occur almost constantly.',6,0,'en',0),(125,'5','Moderate Severe - Generally has difficulty in organising thoughts, as evidenced by frequent irrelevancies, disconnectedness or loosening of associations even when not under pressure.',5,0,'en',0),(125,'4','Moderate - Able to focus thoughts when communications are brief and structured, but becomes loose or irrelevant when dealing with more complex communications or when under minimal pressure.',4,0,'en',0),(128,'1','Absent - Definition does not apply',1,0,'en',0),(127,'1','Absent - Definition does not apply',1,0,'en',0),(127,'2','Minimal - Questionable pathology',2,0,'en',0),(126,'7','Extreme - Patient is almost totally preoccupied with hallucinations, which virtually dominate thinking and behaviour. Hallucinations are provided a rigid delusional interpretation and provoke verbal and behavioural responses, including obedience to command hallucinations.',7,0,'en',0),(126,'6','Severe - Hallucinations are present almost continuously, causing major disruption of thinking and behaviour. Patient treats these as real perceptions, and functioning is impeded by frequent emotional and verbal responses to them.',6,0,'en',0),(126,'5','Moderate Severe - Hallucinations occur frequently, may involve more than one sensory modality, and tend to distort thinking and/or disrupt behaviour. Patient may have a delusional interpretation of these experiences and respond to them emotionally and, on occasion, verbally as well.',5,0,'en',0),(126,'4','Moderate - Hallucinations occur frequently but not continuously, and the patient’s thinking and behaviour are only affected to a minor extent.',4,0,'en',0),(126,'1','Absent - Definition does not apply',1,0,'en',0),(126,'2','Minimal - Questionable pathology',2,0,'en',0),(126,'3','Mild - One or two clearly formed but infrequent hallucinations, or else a number of vague abnormal perceptions which do not result in distortions of thinking or behaviour.',3,0,'en',0),(127,'4','Moderate - Agitation or overarousal is clearly evident throughout the interview, affecting speech and general mobility, or episodic outbursts occur sporadically.',4,0,'en',0),(127,'3','Mild - Tends to be slightly agitated, hypervigilant or mildly overaroused throughout the interview, but without distinct episodes of excitement or marked mood lability. Speech may be slightly pressured.',3,0,'en',0),(128,'2','Minimal - Questionable pathology',2,0,'en',0),(128,'3','Mild - Some expansiveness or boastfulness is evident, but without clear-cut grandiose delusions.',3,0,'en',0),(127,'7','Extreme - marked excitement seriously interferes in eating and sleeping and makes interpersonal interactions virtually impossible. Acceleration of speech and motor activity may result in incoherence and exhaustion.',7,0,'en',0),(127,'6','Severe - Marked excitement dominates the interview, delimits attention, and to some extent affects personal functions such as eating or sleeping.',6,0,'en',0),(127,'5','Moderate Severe - Significant hyperactivity or frequent outbursts of motor activity are observed, making it difficult for the patient to sit still for longer than several minutes at any given time.',5,0,'en',0),(128,'7','Extreme - Thinking, interactions and behaviour are dominated by multiple delusions of amazing ability, wealth, knowledge, fame, power and/or moral stature, which may take on a bizarre quality. ',7,0,'en',0),(128,'6','Severe - Clear-cut delusions of remarkable superiority involving more than one parameter (wealth, knowledge, fame, etc) are expressed, notably influence interactions and may be acted upon.',6,0,'en',0),(128,'5','Moderate Severe - Clear-cut delusions concerning remarkable abilities, status or power are expressed and influence attitude but not behaviour.',5,0,'en',0),(128,'4','Moderate - Feels distinctly and unrealistically superior to others. Some poorly formed delusions about special status or abilities may be present but are not acted upon.',4,0,'en',0),(129,'5','Moderate Severe - Patient shows marked distrustfulness, leading to major disruption of interpersonal relations, or else there are clear-cut persecutory delusions that have limited impact on interpersonal relations and behaviour.',5,0,'en',0),(129,'4','Moderate - Distrustfulness is clearly evident and intrudes on the interview and/or behaviour, but there is no evidence of persecutory delusions. Alternatively, there may be indication of loosely formed persecutory delusions, but these do not seem to affect the patient’s attitude or interpersonal relations.',4,0,'en',0),(129,'1','Absent - Definition does not apply',1,0,'en',0),(129,'2','Minimal - Questionable pathology',2,0,'en',0),(129,'3','Mild - Presents a guarded or even openly distrustful attitude, but thoughts, interactions and behaviour are minimally affected.',3,0,'en',0),(129,'7','Extreme - A network of systematised persecutory delusions dominates the patient’s thinking, social relations and behaviour. ',7,0,'en',0),(129,'6','Severe - Clear-cut pervasive delusions of persecution which may be systematised and significantly interfere in interpersonal relations.',6,0,'en',0),(130,'5','Moderate Severe - Patient is highly irritable and occasionally verbally abusive or threatening.',5,0,'en',0),(130,'6','Severe - Uncooperativeness and verbal abuse or threats notably influence the interview and seriously impact upon social relations. Patient may be violent and destructive but is not physically assualtive towards others.',6,0,'en',0),(130,'4','Moderate - Presents an overtly hostile attitude, showing frequent irritability and direct expression of anger or resentment.',4,0,'en',0),(130,'7','Extreme - Marked anger results in extreme uncooperativeness, precluding other interactions, or in episode(s) of physical assault towards others. ',7,0,'en',0),(131,'7','Extreme – Changes in facial expression and evidence of communicative gestures are virtually absent. Patient seems constantly to show a barren or ‘wooden’ expression. ',7,0,'en',0),(131,'5','Moderate Severe - Affect is generally ‘flat’ with only occasional changes in facial expression and a paucity of communicative gestures.',5,0,'en',0),(131,'6','Severe - Marked flatness and deficiency of emotions exhibited most of the time. There may be unmodulated extreme affective discharges, such as excitement, rage or inappropriate uncontrolled laughter.',6,0,'en',0),(131,'4','Moderate - Reduced range of facial expression and few expressive gestures result in a dull appearance',4,0,'en',0),(131,'1','Absent - Definition does not apply',1,0,'en',0),(131,'2','Minimal - Questionable pathology',2,0,'en',0),(131,'3','Mild - Changes in facial expression and communicative gestures