ition does not apply',1,0,'en',0),(133,'2','Minimal - Questionable pathology',2,0,'en',0),(133,'3','Mild - Conversation is characterised by a stilted, strained or artificial tone. It may lack emotional depth or tend to remain on an impersonal, intellectual plane.',3,0,'en',0),(134,'7','Extreme – Profoundly apathetic, socially isolated and personally neglectful. ',7,0,'en',0),(134,'6','Severe - Tends to be apathetic and isolated, participating very rarely in social activities and occasionally neglecting personal needs. Has very few spontaneous social contacts.',6,0,'en',0),(134,'5','Moderate Severe - Passively participates in only a minority of activities and shows virtually no interest or initiative. Generally spends little time with others.',5,0,'en',0),(134,'1','Absent - Definition does not apply',1,0,'en',0),(134,'2','Minimal - Questionable pathology',2,0,'en',0),(134,'3','Mild - Shows occasional interest in social activities but poor initiative. Usually engages with others only when approached first by them.',3,0,'en',0),(134,'4','Moderate – Passively goes along with most social activities but in a disinterested or mechanical way. Tends to recede into the background.',4,0,'en',0),(135,'6','Severe - Unable to grasp the abstract meaning of any proverbs or figurative expressions and can formulate classifications for only the most simple of similarities. Thinking is either vacuous or locked into functional aspects, salient features and idiosyncratic interpretations.',6,0,'en',0),(135,'7','Extreme - Can use only concrete modes of thinking. Shows no comprehension of proverbs, common metaphors or similes, and simple categories. Even salient and functional attributes do not serve as a basis for classification. This rating may apply to those who cannot interact even minimally with the examiner due to marked cognitive impairment. ',7,0,'en',0),(135,'5','Moderate Severe - Deals primarily in a concrete mode, exhibiting difficulty with most proverbs and many categories.',5,0,'en',0),(136,'6','Severe - Patient’s responses are limited mainly to a few words or short phrases intended to avoid or curtail communication. (e.g. “I don’t know”, “I’m not at liberty to say”). Conversation is seriously impaired as a result and the interview is highly unproductive.',6,0,'en',0),(136,'7','Extreme - Verbal output is restricted to, at most, an occasional utterance, making conversation not possible. ',7,0,'en',0),(135,'1','Absent - Definition does not apply',1,0,'en',0),(135,'2','Minimal - Questionable pathology',2,0,'en',0),(135,'3','Mild - Tends to give literal or personalised interpretations to the more difficult proverbs and may have some problems with concepts that are fairly abstract or remotely related.',3,0,'en',0),(135,'4','Moderate - Often utilises a concrete mode. Has difficulty with most proverbs and some categories. Tends to be distracted by functional aspects and salient features.',4,0,'en',0),(136,'1','Absent - Definition does not apply',1,0,'en',0),(136,'2','Minimal - Questionable pathology',2,0,'en',0),(136,'3','Mild – Conversation shows little initiative. Patient’s answers tend to be brief and unembellished, requiring direct and leading questions by the interviewer.',3,0,'en',0),(136,'4','Moderate – Conversation lacks free flow and appears uneven or halting. Leading questions are frequently needed to elicit adequate responses and proceed with conversation.',4,0,'en',0),(136,'5','Moderate Severe - Patient shows a marked lack of spontaneity and openness, replying to the interviewer’s questions with only one or two brief sentences.',5,0,'en',0),(137,'7','Extreme - Thinking, behaviour and conversation are dominated by constant repetition of fixed ideas or limited phrases, leading to gross rigidity, inappropriateness and restrictiveness of patient’s communication.',7,0,'en',0),(137,'5','Moderate Severe - Thinking is rigid and repetitious to the point that, despite the interviewer’s efforts, conversation is limited to only two or three dominating topics.',5,0,'en',0),(137,'6','Severe – Uncontrolled repetition of demands, statements, ideas or questions which severely impairs conversation.',6,0,'en',0),(137,'4','Moderate - Conversation revolves around a recurrent theme, resulting in difficulty in shifting to a new topic.',4,0,'en',0),(137,'1','Absent - Definition does not apply',1,0,'en',0),(137,'2','Minimal - Questionable pathology',2,0,'en',0),(137,'3','Mild - Some rigidity shown in attitude or beliefs. Patient may refuse to consider alternative positions or have difficulty in shifting from one idea to another.',3,0,'en',0),(138,'7','Extreme – Numerous and frequently reported somatic delusions, or only a few somatic delusions of a catastrophic nature, which totally dominate the patient’s affect or thinking. ',7,0,'en',0),(138,'5','Moderate Severe - Patient expresses numerous or frequent complaints about physical illness or bodily malfunction, or else patient reveals one or two clear-cut delusions involving these themes but is not preoccupied by them.',5,0,'en',0),(138,'6','Severe - Patient is preoccupied by one or a few clear-cut delusions about physical disease or organic malfunction, but affect is not fully immersed in these themes, and thoughts can be diverted by the interviewer with some effort.',6,0,'en',0),(138,'4','Moderate - Complains about poor health or bodily malfunction, but there is no delusional conviction, and overconcern can be allayed by reassurance.',4,0,'en',0),(138,'1','Absent - Definition does not apply',1,0,'en',0),(138,'2','Minimal - Questionable pathology',2,0,'en',0),(138,'3','Mild - Distinctly concerned about health or bodily malfunction, but there is no delusional conviction and overconcern can be allayed by reassurance.',3,0,'en',0),(139,'7','Extreme - Patient’s life is seriously disrupted by anxiety, which is present almost constantly and at times reaches panic proportion or is manifested in actual panic attacks. ',7,0,'en',0),(139,'5','Moderate Severe - Patient reports serious problems of anxiety which have significant physical and behavioural consequences, such as marked tension, poor concentration, palpitations or impaired sleep.',5,0,'en',0),(139,'6','Severe - Subjective state of almost constant fear associated with phobias, marked restlessness or numerous somatic manifestations.',6,0,'en',0),(139,'1','Absent - Definition does not apply',1,0,'en',0),(139,'2','Minimal - Questionable pathology',2,0,'en',0),(139,'3','Mild - Expresses some worry, overconcern or subjective restlessness, but no somatic and behavioural consequences are reported or evidenced.',3,0,'en',0),(139,'4','Moderate - Patient reports distinct symptoms of nervousness, which are reflected in mild physical manifestations such as fine hand tremor and excessive perspiration.',4,0,'en',0),(140,'7','Extreme - Patient’s life is dominated by unshakable delusions of guilt, for which he feels deserving of drastic punishment, such as life imprisonment, torture, or death. There may be associated suicidal thoughts or attribution of others’ problems to one’s own past misdeeds. ',7,0,'en',0),(140,'4','Moderate - Patient expresses distinct concern over his responsibility for a real incident in his life but is not pre-occupied with it and attitude and behaviour are essentially unaffected.',4,0,'en',0),(140,'5','Moderate Severe - Patient expresses a strong sense of guilt associated with self deprecation or the belief that he deserves punishment. The guilt feelings may have a delusional basis, may be volunteered spontaneously, may be a source of preoccupation and/or depressed mood, and cannot be allayed readily by the interviewer.',5,0,'en',0),(140,'6','Severe - Strong ideas of guilt take on a delusional quality and lead to an attitude of hopelessness or worthlessness. The patient believes he should receive harsh sanctions as such punishment.',6,0,'en',0),(140,'1','Absent - Definition does not apply',1,0,'en',0),(140,'2','Minimal - Questionable pathology',2,0,'en',0),(140,'3','Mild – Questioning elicits a vague sense of guilt or self-blame for a minor incident, but the patient clearly is not overly concerned.',3,0,'en',0),(141,'7','Extreme - Marked tension is manifested by signs of panic or gross motor acceleration, such as rapid restless pacing and inability to remain seated for longer than a minute, which makes sustained conversation not possible. ',7,0,'en',0),(141,'5','Moderate Severe - Pronounced tension is evidenced by numerous manifestations, such as nervous shaking, profuse sweating and restlessness, but can conduct in the interview is not significantly affected.',5,0,'en',0),(141,'6','Severe - Pronounced tension to the point that interpersonal interactions are disrupted. The patient, for example, may be constantly fidgeting, unable to sit still for long, or show hyperventilation.',6,0,'en',0),(141,'1','Absent - Definition does not apply',1,0,'en',0),(141,'2','Minimal - Questionable pathology',2,0,'en',0),(141,'3','Mild - Posture and movements indicate slight apprehensiveness, such as minor rigidity, occasional restlessness, shifting of position, or fine rapid hand tremor.',3,0,'en',0),(141,'4','Moderate - A clearly nervous appearance emerges from various manifestations, such as fidgety behaviour, obvious hand tremor, excessive perspiration, or nervous mannerisms.',4,0,'en',0),(142,'7','Extreme - Functioning is seriously impaired by virtually constant involvement in ritualistic, manneristic, or stereotyped movements or by an unnatural fixed posture which is sustained most of the time. ',7,0,'en',0),(143,'7','Extreme - Depressive feelings seriously interfere in most major functions. The manifestations include frequent crying, pronounced somatic symptoms, impaired concentration, psychomotor retardation, social disinterest, self neglect, possible depressive or nihilistic delusions and/or possible suicidal thoughts or action. ',7,0,'en',0),(142,'1','Absent - Definition does not apply',1,0,'en',0),(142,'2','Minimal - Questionable pathology',2,0,'en',0),(142,'3','Mild - Slight awkwardness in movements or minor rigidity of posture',3,0,'en',0),(142,'4','Moderate – Movements are notably awkward or disjointed, or an unnatural posture is maintained for brief periods.',4,0,'en',0),(142,'5','Moderate Severe - Occasional bizarre rituals or contorted posture are observed, or an abnormal position is sustained for extended periods.',5,0,'en',0),(142,'6','Severe - Frequent repetition of bizarre rituals, mannerisms or stereotyped movements, or a contorted posture is sustained for extended periods.',6,0,'en',0),(143,'6','Severe - Markedly depressed mood is associated with sustained feelings of misery, occasional crying, hopelessness and worthlessness. In addition, there is major interference in appetite and or sleep as well as in normal motor and social functions, with possible signs of self-neglect.',6,0,'en',0),(144,'1','Absent - Definition does not apply',1,0,'en',0),(144,'2','Minimal - Questionable pathology',2,0,'en',0),(144,'3','Mild - Slight but noticeable diminution in rate of movements and speech. Patient may be somewhat underproductive in conversation and gestures.',3,0,'en',0),(143,'5','Moderate Severe - Distinctly depressed mood is associated with obvious sadness, pessimism, loss of social interest, psychomotor retardation and some interference in appetite and sleep. The patient cannot be easily cheered up.',5,0,'en',0),(144,'7','Extreme - Patient is almost completely immobile and virtually unresponsive to external stimuli.',7,0,'en',0),(143,'1','Absent - Definition does not apply',1,0,'en',0),(143,'2','Minimal - Questionable pathology',2,0,'en',0),(143,'3','Mild - Expresses some sadness of discouragement only on questioning, but there is no evidence of depression in general attitude or demeanor.',3,0,'en',0),(143,'4','Moderate - Distinct feelings of sadness or hopelessness, which may be spontaneously divulged, but depressed mood has no major impact on behaviour or social functioning and the patient usually can be cheered up.',4,0,'en',0),(144,'6','Severe - Movements are extremely slow, resulting in a minimum of activity and speech. Essentially the day is spent sitting idly or lying down.',6,0,'en',0),(144,'4','Moderate - Patient is clearly slow in movements, and speech may be characterised by poor productivity including long response latency, extended pauses or slow pace.',4,0,'en',0),(144,'5','Moderate Severe – A marked reduction in motor activity renders communication highly unproductive or delimits functioning in social and occupational situations. Patient can usually be found sitting or lying down.',5,0,'en',0),(145,'6','Severe - Patient is highly uncooperative, negativistic and possibly also belligerent. Refuses to comply with the most social demands and may be unwilling to initiate or conclude the full interview.',6,0,'en',0),(145,'7','Extreme - Active resistance seriously impact on virtually all major areas of functioning. Patient may refuse to join in any social activities, tend to personal hygiene, converse with family or staff and participate even briefly in an interview. ',7,0,'en',0),(145,'4','Moderate - Occasional outright refusal to comply with normal social demands, such as making own bed, attending scheduled programmes, etc. The patient may project a hostile, defensive or negative attitude but usually can be worked with.',4,0,'en',0),(145,'5','Moderate Severe - Patient frequently is incompliant with the demands of his milieu and may be characterised by other as an “outcast” or having “a serious attitude problem”. Uncooperativeness is reflected in obvious defensiveness or irritability with the interviewer and possible unwillingness to address many questions.',5,0,'en',0),(146,'5','Moderate Severe - Patient expresses many strange and fantastic thoughts, (e.g. Being the adopted son of a king, being an escapee from death row), or some which are patently absurd (e.g. Having hundreds of children, receiving radio messages from outer space from a tooth filling).',5,0,'en',0),(146,'6','Severe - Patient expresses many illogical or absurd ideas or some which have a distinctly bizarre quality (e.g. having three heads, being a visitor from another planet).',6,0,'en',0),(146,'7','Extreme - Thinking is replete with absurd, bizarre and grotesque ideas. ',7,0,'en',0),(145,'1','Absent - Definition does not apply',1,0,'en',0),(145,'2','Minimal - Questionable pathology',2,0,'en',0),(145,'3','Mild - Complies with an attitude of resentment, impatience, or sarcasm. May inoffensively object to sensitive probing during the interview.',3,0,'en',0),(146,'3','Mild - Thought content is somewhat peculiar, or idiosyncratic, or familiar ideas are framed in an odd context.',3,0,'en',0),(146,'4','Moderate - Ideas are frequently distorted and occasionally seem quite bizarre.',4,0,'en',0),(146,'1','Absent - Definition does not apply',1,0,'en',0),(146,'2','Minimal - Questionable pathology',2,0,'en',0),(147,'6','Severe - Marked failure in recognising persons, place and time. For example, patient has no knowledge of his whereabouts, confuses the date by more than one year, can name only one or two individuals in his current life.',6,0,'en',0),(147,'7','Extreme - Patient appears completely disorientated with regard to persons, place and time. There is gross confusion or total ignorance about one’s location, the current year and even the most familiar people, such as parents, spouse, friends and primary therapist. ',7,0,'en',0),(147,'5','Moderate Severe - Considerable failure in recognising persons, place and time. Patient has only a vague notion of where he is and seems unfamiliar with most people in his milieu. He may identify the year correctly or nearly but not know the current month, day of week or even the season.',5,0,'en',0),(147,'1','Absent - Definition does not apply',1,0,'en',0),(147,'2','Minimal - Questionable pathology',2,0,'en',0),(147,'3','Mild - General orientation is adequate but there is some difficulty with specifics. For example, patient knows his location but not the street address, knows hospital staff names but not their functions, knows the month but confuses the day of the week with an adjacent day, or errs in the date by more than two days. There may be narrowing of interest evidenced by familiarity with the immediate but not extended milieu, such as ability to identify staff but not the mayor, governor, or president.',3,0,'en',0),(147,'4','Moderate - Only partial success in recognising persons, places and time. For example, patient knows he is in a hospital but not its name, knows the name of the city but not the borough or district, knows the name of his primary therapist but not many other direct care workers, knows the year or season but not sure of the month.',4,0,'en',0),(150,'7','Extreme – Almost complete failure of volition is manifested by gross inhibition of movement and speech resulting in immobility and/or mutism. ',7,0,'en',0),(149,'1','Absent - Definition does not apply',1,0,'en',0),(149,'2','Minimal - Questionable pathology',2,0,'en',0),(149,'3','Mild - Recognises having a psychiatric disorder but clearly underestimates its seriousness, the implications for treatment, or the importance of taking measures to avoid relapse. Future planning may be poorly conceived.',3,0,'en',0),(149,'4','Moderate - Patient shows only a vague or shallow recognition of illness. There may be fluctuations in acknowledgement of being ill or little awareness of major symptoms which are present, such as delusions, disorganised thinking, suspiciousness and social withdrawal. The patient may rationalise the need for treatment in terms of its relieving lesser symptoms, such as anxiety, tension and sleep difficulty.',4,0,'en',0),(149,'5','Moderate Severe - Acknowledges past but not present psychiatric disorder. If challenged, the patient may concede the presence of some unrelated or insignificant symptoms, which tend to be explained away by gross misinterpretation or delusional thinking. The need for psychiatric treatment similarly goes unrecognised.',5,0,'en',0),(149,'6','Severe - Patient denies ever having had a psychiatric disorder. He disavows the presence of any psychiatric symptoms in the past or present and, though compliant, denies the need for treatment and hospitalisation.',6,0,'en',0),(149,'7','Extreme - Emphatic denial of past and present psychiatric illness. Current hospitalisation and treatment are given a delusional interpretation (e.g. as punishment from misdeeds, as persecution by tormentors, etc), and the patient thus refuse to cooperate with therapists, medication or other aspects of treatment. ',7,0,'en',0),(150,'1','Absent - Definition does not apply',1,0,'en',0),(150,'2','Minimal - Questionable pathology',2,0,'en',0),(150,'3','Mild - There is evidence of some indecisiveness in conversation and thinking, which may impede verbal and cognitive processes to a minor extent.',3,0,'en',0),(150,'4','Moderate - Patient is often ambivalent and shows clear difficulty in reaching decisions. Conversation may be marred by alteration in thinking, and in consequence, verbal and cognitive functioning are clearly impaired.',4,0,'en',0),(150,'5','Moderate Severe - Disturbance of volition interferes in thinking as well as behaviour. Patient shows pronounced indecision that impedes the initiation and continuation of social and motor activities, and which also may be evidence in halting speech.',5,0,'en',0),(45,'A1','Not at all',1,0,'en',0),(42,'A4','Most of the time',4,3,'en',0),(42,'A5','All of the time',5,4,'en',0),(55,'A1','0 - 1 Would not avoid it ',1,0,'en',0),(51,'A4','Very Often',4,3,'en',0),(54,'A4','Somewhat of a Problem',4,3,'en',0),(54,'A5','Problematic',5,4,'en',0),(54,'A1','Excellent',1,0,'en',0),(54,'A2','Above Average',2,1,'en',0),(54,'A3','Average',3,2,'en',0),(53,'A1','Excellent',1,0,'en',0),(53,'A2','Average',2,1,'en',0),(53,'A3','Above Average',3,2,'en',0),(53,'A4','Somewhat of a Problem',4,3,'en',0),(53,'A5','Problematic',5,4,'en',0),(51,'