INSERT INTO `lime_groups` VALUES (1,581341,'Self-Rated Level 1 Cross-Cutting Symptom Measure—Adult',0,'<div><strong>Instructions: </strong>The questions below ask about things that might have bothered you. For each question, circle the number that best<br />\ndescribes how much (or how often) you have been bothered by each problem during the past TWO (2) WEEKS. INFO: Q1003 http://www.dsm5.org/Pages/Feedback-Form.aspx</div>\n\n<div>http://www.appi.org/CustomerService/Pages/Permissions.aspx</div>\n','en','',''),(2,581341,'LEVEL 2—Anxiety—Adult',2,'<div><strong>Instructions to patient: On the DSM-5 Level 1 cross-cutting questionnaire that you just completed, you indicated that during the past 2 weeks you (individual receiving care) have been bothered by “feeling nervous, anxious, frightened, worried, or on edge”, “feeling panic or being frightened”, and/or “avoiding situations that make you anxious” at a mild or greater level of severity. The questions below ask about these feelings in more detail and especially how often you (individual receiving care) have been bothered by a list of symptoms during the past 7 days. Please respond to each item by marking one box per row. INFO: Q1005 http://www.dsm5.org/Pages/Feedback-Form.aspx</strong></div>\n','en','',''),(3,581341,'LEVEL 2—Sleep Disturbance—Adult',5,'<div><strong>Instructions to patient: On the DSM-5 Level 1 cross-cutting questionnaire that you just completed, you indicated that during the past 2 weeks you (the individual receiving care) have been bothered by “problems with sleep that affected your sleep quality over all” at a mild or greater level of severity. The questions below ask about these feelings in more detail and especially how often you (the individual receiving care) have been bothered by a list of symptoms during the past 7 days. Please respond to each item by marking. INFO: Q1008 http://www.dsm5.org/Pages/Feedback-Form.aspx</strong></div>\n','en','',''),(4,581341,'LEVEL 2—Anger—Adult',1,'<div><strong>Instructions: On the DSM-5 Level 1 cross-cutting questionnaire that you just completed, you indicated that during the past 2 weeks you (the individual receiving care) have been bothered by “feeling irritated, grouchy, or angry” at a mild or greater level of severity. The questions below ask about these feelings in more detail and especially how often you (the individual receiving care) have been bothered by a list of symptoms during the past 7 days. Please respond to each item by marking one box per row. INFO: Q1004 http://www.dsm5.org/Pages/Feedback-Form.aspx</strong></div>\n','en','',''),(5,581341,'LEVEL 2 - Mania - Adult (ASRM-Altman Self Rating Mania Scale)',3,'<div><u><strong>Instructions</strong></u>: On the DSM-5 Level 1 cross-cutting questionnaire you just completed, you indicated that <u><em>during the past 2 weeks</em></u> you (the individual receiving care) have been bothered by “sleeping less than usual, but still having a lot of energy” and/or “starting lots more projects than usual or doing more risky things than usual” at a mild or greater level of severity. The five statement groups or questions below ask about these feelings in more detail. INFO: Q1006 http://www.dsm5.org/Pages/Feedback-Form.aspx</div>\n\n<div> </div>\n\n<ol>\n	<li>\n	<div><strong>Please read each group of statements/question carefully.</strong></div>\n	</li>\n	<li>\n	<div> Choose the one statement in each group that best describes the way you (the individual receiving care) have been feeling for <u><strong>the past week.</strong></u></div>\n	</li>\n	<li>\n	<div>Check the box  next to the number/statement selected.</div>\n	</li>\n	<li>\n	<div><strong>Please note: </strong>The word “occasionally” when used here means once or twice; “often” means several times or more and “frequently” means most of the time.</div>\n	</li>\n</ol>\n','en','',''),(6,581341,'LEVEL 2—Repetitive Thoughts and Behaviors—Adult',4,'<div>Instructions: On the DSM-5 Level 1 cross-cutting questionnaire that you just completed, you indicated that during the past 2</div>\n\n<div>weeks you have been bothered by “unwanted repeated thoughts, images, or urges” and/or “being driven to perform certain</div>\n\n<div>behaviors or mental acts over and over” at a mild or greater level of severity. The questions below ask about these feelings in</div>\n\n<div>more detail and especially how often you have been bothered by a list of symptoms during the past 7 days. Please respond to</div>\n\n<div>each item by marking one box per row. INFO: Q1007 http://www.dsm5.org/Pages/Feedback-Form.aspx</div>\n','en','',''),(7,581341,'LEVEL 2—Somatic Symptom—Adult Patient',6,'<div><strong>Instructions:</strong> On the DSM-5 Level 1 cross-cutting questionnaire that you just completed, you indicated that during the <em>past 2 weeks</em> you (the individual receiving care) have been bothered by “unexplained aches and pains”, and/or “feeling that your illnesses are not being taken seriously enough” at a mild or greater level of severity. The questions below ask about these feelings in more detail and especially how often you (the individual receiving care) have been bothered by a list of symptoms <u><strong>during the past 7 days</strong></u>. <strong>Please respond to each item by marking one box per row. INFO: Q1009 http://www.dsm5.org/Pages/Feedback-Form.aspx</strong></div>\n','en','',''),(8,581341,'LEVEL 2—Substance Use—Adult',7,'<div><strong>Instructions: </strong>On the DSM-5 Level 1 cross-cutting questionnaire that you just completed, you indicated that <em>during the past 2 weeks</em> you (the individual receiving care) have been bothered by “using medicines on your own without a doctor’s prescription, or in greater amounts or longer than prescribed, and/or using drugs like marijuana, cocaine or crack, and/or other drugs” at a slight or greater level of severity. The questions below ask how often you (the individual receiving care) have used these medicines and/or substances <strong>during the past 2 weeks. Please respond to each item by marking one box per row. INFO: Q1010 http://www.dsm5.org/Pages/Feedback-Form.aspx</strong></div>\n','en','',''),(9,581341,'Severity Measure for Agoraphobia—Adult',8,'<div><strong>Instructions:</strong> The following questions ask about thoughts, feelings, and behaviors you may have had in the following situations: crowds, public places, using transportation (e.g., buses, planes, trains), traveling alone, or away from home. <strong>Please respond to each item by marking one box per row. INFO: Q1011 http://www.dsm5.org/Pages/Feedback-Form.aspx http://www.appi.org/CustomerService/Pages/Permissions.aspx</strong></div>\n','en','',''),(10,581341,'Depression - Severity Measure —Adult',9,'<div><strong>Instructions:</strong> Over the <strong>last 7 days</strong>, how often have you been bothered by any of the following problems? (Use “” to indicate your answer) INFO: Q1012 http://www.dsm5.org/Pages/Feedback-Form.aspx</div>\n','en','',''),(11,581341,'Generalized Anxiety Disorder - Severity Measure —Adult',10,'<div><strong>Instructions:</strong> The following questions ask about thoughts, feelings, and behaviors, often tied to concerns about family, health, finances, school, and work. <strong>Please respond to each item by marking one box per row. </strong>INFO: Q1013 http://www.dsm5.org/Pages/Feedback-Form.aspx http://www.appi.org/CustomerService/Pages/Permissions.aspx</div>\n','en','',''),(12,581341,'Panic Disorder - Severity Measure —Adult',11,'<div><strong>Instructions:</strong> The following questions ask about thoughts, feelings, and behaviors about panic attacks. A panic attack is an episode of intense fear that sometimes comes out of the blue (for no apparent reason). The symptoms of a panic attack include: a racing heart, shortness of breath, dizziness, sweating, and fear of losing control or dying. <strong>Please respond to each item by marking one box per row. </strong>INFO: 1014 http://www.dsm5.org/Pages/Feedback-Form.aspx http://www.appi.org/CustomerService/Pages/Permissions.aspx</div>\n','en','',''),(13,581341,' Separation Anxiety Disorder - Severity Measure  —Adult',12,'<div><strong>Instructions:</strong> The following questions ask about thoughts, feelings, and behaviors that you may have had about being separated from home or from people who are important to you. Please rate how often the following statements are true for you. <strong>Please respond to each item by marking one box per row. </strong>INFO: 1015 http://www.dsm5.org/Pages/Feedback-Form.aspx http://www.appi.org/CustomerService/Pages/Permissions.aspx</div>\n','en','',''),(14,581341,'Social Anxiety Disorder (Social Phobia) - Severity Measure —Adult',13,'<div><u><strong>Instructions:</strong></u> The following questions ask about thoughts, feelings, and behaviors that you may have had about social situations. Usual social situations include: public speaking, speaking in meetings, attending social events or parties, introducing yourself to others, having conversations, giving and receiving compliments, making requests</div>\n\n<div>of others, and eating and writing in public. <strong>Please respond to each item by marking one box per row.</strong></div>\n\n<div> </div>\n\n<div><strong>INFO: Q1016</strong></div>\n','en','',''),(15,581341,'Acute Stress Symptoms - Severity Measure —Adult',14,'<div><strong>Instructions:</strong> People sometimes have problems after extremely stressful events or experiences. How much have you been bothered during the PAST SEVEN (7) DAYS by each of the following problems that occurred or became worse after an extremely stressful event/experience? <strong>Please respond to each item by marking one box per row. </strong>INFO: Q1017 http://www.dsm5.org/Pages/Feedback-Form.aspx http://www.appi.org/CustomerService/Pages/Permissions.aspx</div>\n','en','',''),(16,581341,'Dissociative Symptoms - Severity Measure —Adult',15,'<div><strong>Instructions:</strong> For each statement below, please check () the box that best answers each question to show how much each thing has happened to you in the past SEVEN (7) DAYS. INFO: Q1018 http://www.dsm5.org/Pages/Feedback-Form.aspx</div>\n','en','',''),(17,581341,'Posttraumatic Stress Symptoms - Severity Measure —Adult',16,'<div><strong>Instructions:</strong> People sometimes have problems after extremely stressful events or experiences. How much have you been bothered during the PAST SEVEN (7) DAYS by each of the following problems that occurred or became worse after an extremely stressful event/experience? <strong>Please respond to each item by marking one box per row. </strong>INFO: Q1019 http://www.dsm5.org/Pages/Feedback-Form.aspx http://www.appi.org/CustomerService/Pages/Permissions.aspx</div>\n','en','',''),(18,581341,'NICHQ Vanderbilt Assessment Scale—TEACHER Informant',17,'<div><strong>Directions: Each rating should be considered in the context of what is appropriate for the age of the child you are rating and should reflect that child’s behavior since the beginning of the school year. Please indicate the number of weeks or months you have been able to evaluate the behaviors: INFO: Q1025</strong></div>\n','en','',''),(19,581341,'Agoraphobia Questionnaire',18,'<div><strong>0-1: Would not avoid it. 2-3: Slightly avoid it. 4-5: Definitely avoid it. 6-7: Markedly avoid it. 8: Always avoid it</strong></div>\n\n<div>Choose a number using the scale above to show how much you would avoid each of the situations listed below because of fear or other unpleasant feelings. INFO: Q1027</div>\n','en','',''),(20,581341,'CES-DC (Center for Epidemiological Studies Depression Scale for Children)',19,'<div><span style=\"font-size:14px;\"><strong>Instructions:</strong> Below is a list of the ways you might have felt or acted. Please check how much you have felt this way during the past week. INFO: Q1032</span></div>\n','en','',''),(21,581341,'CY-BOCS-Parent (The Children\'s Yale-Brown Obsessive-Compulsive Scale - Parent Report)',20,'<div>Please select the option that best describes your child over the past week. Please answer the next 5 questions about the obsessions or thoughts your child cannot stop thinking about. Obsessions are thoughts, ideas, or pictures that keep coming into your child\'s mind even though he or she does not want them to. INFO: Q1034</div>\n','en','',''),(22,581341,'GAD-7 (Generalized Anxiety Disorder - 7)',21,'<div>Please read each statement and select a number 0, 1, 2 or 3 which indicates how much the statement applied to you over the past two weeks. There are no right or wrong answers. Do not spend too much time on any one statement. This assessment is not intended to be a diagnosis. If you are concerned about your results in any way, please speak with a qualified health professional. INFO: Q1036</div>\n','en','',''),(23,581341,'GDS (Geriatric Depression Scale)',22,'<div><strong>Instructions:</strong> Select the answer that best describes how you felt over the past week. INFO: Q1037</div>\n','en','',''),(24,581341,'CES-D (Center for Epidemiological Studies Depression Scale)',23,'<div>Below is a list of the ways you might have felt or behaved. Please tell me how often you have felt this way during the past week. INFO: Q1038</div>\n','en','',''),(25,581341,'HDCL-C (The Johns Hopkins Depression Checklist for Children)',24,'<div><strong>JOHNS HOPKINS DEPRESSION CHECKLIST FOR CHILDREN (HDCL-C)</strong> INFO: Q1039</div>\n','en','',''),(26,581341,'Iowa Personality Disorder Screener',25,'<div>The questions listed below relate to your thoughts and feelings. If the way you have been in recent weeks or months differs from the way you usually are, please answer based on when you were your usual self. INFO: Q1040</div>\n','en','',''),(27,581341,'MDQ (The Mood Disorder Questionnaire)',26,'<div><strong>Instructions:</strong> Please answer each question to the best of your ability. INFO: Q1041</div>\n','en','',''),(28,581341,'PCL-C (PTSD CheckList - Civilian Version)',27,'<div>The next questions are about problems and complaints that people sometimes have in response to TRAUMATIC life experiences. (e.g. fire, flood, natural disaster, accident, physical or sexual assault, combat, witnessing a death etc ). ONLY ANSWER THIS IF YOU HAVE HAD SUCH AN EXPERIENCE, If so, please indicate how much you have been bothered by each problem in the past month. ANSWER EACH WITH RESPECT TO THE TRAUMA YOU SUFFERED, NOT AS AN INDICATOR OF THE GENERAL DISTRESS YOU MIGHT BE FEELING NOW. INFO: Q1044</div>\n','en','',''),(29,581341,'QDIS-16 (QUICK INVENTORY OF DEPRESSIVE SYMPTOMATOLOGY (SELF-REPORT))',28,'<div><em><strong>Only the patient (subject) should enter information onto this questionnaire</strong></em></div>\n\n<div><strong>PLEASE CHECKMARK THE ONE RESPONSE TO EACH ITEM THAT IS MOST APPROPRIATE TO HOW YOU HAVE BEEN FEELING OVER THE PAST 7 DAYS. INFO: 1049</strong></div>\n','en','',''),(30,581341,'SCARED-Child (Screening for Child Anxiety Related Disorders-Child)',29,'<div>Directions: Below is a list of sentences that describe how people feel. Read each phrase and decide if it is \"Not True or Hardly Ever True\" or \"Somewhat True or Sometimes True\" or \"Very True or Often True\" for you. Then, for each sentence, fill in one circle that corresponds to the response that seems to describe you for the last three (3) months. INFO: Q1051</div>\n','en','',''),(31,581341,'SCARED-Parent (Screening for Child Anxiety Related Disorders-Parent)',30,'<div>Directions: Below is a list of sentences that describe how people feel. Read each phrase and decide if it is \"Not True or Hardly Ever True\" or \"Somewhat True or Sometimes True\"or \"Very True or Often True\" for your child. Then, for each sentence, fill in one circle that corresponds to the response that seems to describe your child for the last three (3) months. Please respond to ALL statements as well as you can, even if some do not seem to concern your child. INFO: Q1052</div>\n','en','',''),(32,581341,'SPIN (Social Phobia Inventory)',31,'<div>Please respond to the degree that the following problems have bothered you during the past week. For these items, the response options are “not at all”, “a little bit”, “somewhat”, “very much”, and “extremely”. INFO: Q1054</div>\n','en','',''),(33,581341,'Vanderbilt Assessment Scale - Parent',32,'<div><strong>Directions:</strong> Each rating should be considered in the context of what is appropriate for the age of your child. When completing this form, please think about your child\'s behaviors in the past 6 months. INFO: Q1056</div>\n','en','',''),(34,581341,'C-SSRS: Daily/Shift Screen',33,'','en','',''),(35,581341,'C-SSRS: Screener/Recent – Self-Report',34,'<div style=\"text-align: center;\"><strong>COLUMBIA-SUICIDE SEVERITY RATING SCALE</strong></div>\n\n<div style=\"text-align: center;\"><strong>Screener/Recent – Self-Report INFO: Q1023</strong></div>\n','en','',''),(36,581341,'C-SSRS: Psychiatric Inpatient Setting – Discharge Screener',35,'<div style=\"text-align: center;\"><strong>COLUMBIA-SUICIDE SEVERITY RATING SCALE</strong></div>\n\n<div style=\"text-align: center;\"><strong>Psychiatric Inpatient Setting – Discharge Screener. INFO: Q1024</strong></div>\n\n<div> </div>\n','en','',''),(37,581341,'NIDA- Modified ASSIST',36,'<div><strong>Instructions:</strong> For each substance, mark in the appropriate column. For example, if the patient has used cocaine monthly in the past year, put a mark in the “Monthly” column in the “illegal drug” row. INFO: Q1042</div>\n','en','',''),(38,581341,'PDSS (Panic Disorder Severity Scale)',37,'<div><strong>Instructions. </strong>Several of the following questions refer to panic attacks and limited symptom attacks. For this questionnaire, a <em>panic attack</em> is defined as a <u>sudden rush</u> of fear or discomfort accompanied by <u>at least 4 of the symptoms listed below</u>. In order to qualify as a sudden rush, the symptoms must <u>peak within 10 minutes</u>. Episodes like panic attacks but having fewer than 4 of the listed symptoms are called <em>limited symptom attacks</em>. Here are the symptoms to count:</div>\n\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n	<tbody>\n		<tr>\n			<td style=\"width:211px;height:91px;\">\n			<ul>\n				<li>\n				<div>Rapid or pounding heartbeat</div>\n				</li>\n				<li>\n				<div>Sweating</div>\n				</li>\n				<li>\n				<div>Trembling or shaking</div>\n				</li>\n				<li>\n				<div>Breathlessness</div>\n				</li>\n				<li>\n				<div>Feeling of choking</div>\n				</li>\n			</ul>\n			</td>\n			<td style=\"width:192px;height:91px;\">\n			<ul>\n				<li>\n				<div>Chest pain or discomfort</div>\n				</li>\n				<li>\n				<div>Nausea</div>\n				</li>\n				<li>\n				<div>Dizziness or faintness</div>\n				</li>\n				<li>\n				<div>Feelings of unreality</div>\n				</li>\n				<li>\n				<div>Numbness or tingling</div>\n				</li>\n			</ul>\n			</td>\n			<td style=\"width:235px;height:91px;\">\n			<ul>\n				<li>\n				<div>Chills or hot flushes</div>\n				</li>\n				<li>\n				<div>Fear of losing control or going crazy</div>\n				</li>\n				<li>\n				<div>Fear of dying</div>\n				</li>\n			</ul>\n\n			<div> </div>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<div>For each question below, circle the number of the answer that best describes your experience during the <u>past week</u>. INFO: Q1047</div>\n','en','',''),(39,581341,'PANSS (Positive and Negative Syndrome Scale)',38,'<div><strong>Scoring Procedure </strong></div>\n\n<div>Tick appropriate box for each item. INFO: Q1043</div>\n','en','',''),(40,581341,'YMRS (Young Mania Rating Scale) NOT SELF REPORT',39,'<div><strong>Instructions:</strong> For each item below, circle the response that best describes how you felt or behaved during the <u>past 48 hours</u>. INFO: Q1058</div>\n','en','',''),(41,581341,'EDE-Q (Eating Disorder Examination Questionnaire)',40,'<div><strong>Instructions:</strong> <strong>The following questions are concerned with the past four weeks (28 days) only. Please read each question carefully. Please answer all the questions. Thank you. Questions 1 to 12: Please circle the appropriate number on the right. Remember that the questions only refer to the past four weeks (28 days) only. INFO: 1035</strong></div>\n','en','',''),(42,572748,'test',0,'test','en','test','test'),(43,581341,'Notice of Privacy Practices - HIPPA',41,'','en','',''),(44,581341,'Authorization for release of identifying health information',42,'','en','',''),(45,581341,'Consent to Participate in a Telemedicine Consultation',43,'','en','',''),(46,581341,'Adults: Initial Questionnaire',44,'','en','',''),(47,581341,'Adult Intake Form',45,'','en','',''),(48,581341,'Child/ Adolescent Initial Questionnaire',46,'','en','',''),(49,581341,'Lifestyle and nutrition questionnaire',47,'','en','',''),(50,581341,'Child and adolescent psychiatric intake form',48,'','en','',''),(51,581341,'Consent for Psychotherapy Treatment',49,'','en','','');
