,'','','N','Y',5,'en',0,0,'1',''),(63,0,581341,21,'L','Q1034E5','<p>5. When your child tries to fight the thoughts, can he or she beat them?</p>\n','','','N','Y',6,'en',0,0,'1',''),(64,0,581341,21,'X','Q1034E6','<p>Please answer the next 5 questions about the compulsions or habits your child cannot stop doing. Compulsions are things that your child feels he or she has to do although he or she may know they do not make sense. Sometimes your child may try to stop from doing them but this might not be possible. Your child might feel worried or angry or scared until he or she has finished what he or she has to do.</p>\n','','','N','N',7,'en',0,0,'1',NULL),(65,0,581341,21,'L','Q1034E7','<p>6. How much time does your child spend doing these things in a day?</p>\n','','','N','Y',8,'en',0,0,'1',NULL),(66,0,581341,21,'L','Q1034E8','<p>7. How much do these habits get in the way of school or doing things with his or her friends?</p>\n','','','N','Y',9,'en',0,0,'1',NULL),(67,0,581341,21,'L','Q1034E9','<p>8. How upset would your child feel if he or she could not do his or her habits?</p>\n','','','N','Y',10,'en',0,0,'1',NULL),(68,0,581341,21,'L','Q1034E10','<p>9. How hard does your child try to stop or fight the habits?</p>\n','','','N','Y',11,'en',0,0,'1',NULL),(69,0,581341,21,'L','Q1034E11','<p>10. When your child tries to fight the habits, can he or she beat them?</p>\n','','','N','Y',12,'en',0,0,'1',NULL),(70,0,581341,22,'F','Q1036','','','','N','Y',0,'en',0,0,'1',NULL),(71,0,581341,23,'C','Q1037','','','','N','Y',0,'en',0,0,'1',''),(72,0,581341,24,'F','Q1038','During the Past Week','','','N','Y',0,'en',0,0,'1',''),(73,0,581341,25,'F','Q1039','Observations','','','N','Y',0,'en',0,0,'1',NULL),(74,0,581341,26,'F','Q1040','','','','N','Y',0,'en',0,0,'1',''),(75,0,581341,27,'F','Q1041LV2','1. Has there ever been a period of time when you were not your usual self and...','','','N','Y',0,'en',0,0,'1',''),(76,0,581341,27,'Y','Q1041C1S14LV2','<p>2. If you checked YES to more than one of the above, have several of these ever happened during the same period of time?</p>\n','','','N','Y',1,'en',0,0,'1',''),(77,0,581341,27,'F','Q1041C1S15LV2','','','','N','Y',2,'en',0,0,'1',''),(78,0,581341,27,'F','Q1041C1S16LV2','','','','N','Y',3,'en',0,0,'1',''),(79,0,581341,28,'F','Q1044','','','','N','Y',0,'en',0,0,'1',NULL),(80,0,581341,29,'L','Q1049','1. Falling asleep:','','','N','Y',0,'en',0,0,'1',NULL),(81,0,581341,29,'L','Q1049E','2. Sleep during the night:','','','N','Y',1,'en',0,0,'1',NULL),(82,0,581341,29,'L','Q1049E1','3. Waking up too early:','','','N','Y',2,'en',0,0,'1',NULL),(83,0,581341,29,'L','Q1049E2','4. Sleeping too much:','','','N','Y',3,'en',0,0,'1',NULL),(84,0,581341,29,'L','Q1049E3','5. Feeling sad:','','','N','Y',4,'en',0,0,'1',NULL),(85,0,581341,29,'X','Q1049E4','<strong>Please complete either 6 or 7 (not both)</strong>','','','N','N',5,'en',0,0,'1',''),(86,0,581341,29,'L','Q1049E5','6. Decreased appetite:','','','N','N',6,'en',0,0,'1',''),(87,0,581341,29,'L','Q1049E6','7. Increased appetite:','','','N','N',7,'en',0,0,'1',NULL),(88,0,581341,29,'X','Q1049E7','<strong>Please complete either 8 or 9 (not both)</strong>','','','N','N',8,'en',0,0,'1',''),(89,0,581341,29,'L','Q1049E8','8. Decreased weight (within the last 14 days):','','','N','N',9,'en',0,0,'1',NULL),(90,0,581341,29,'L','Q1049E9','9. Increased weight (within the last 14 days):','','','N','N',10,'en',0,0,'1',NULL),(91,0,581341,29,'L','Q1049E10','10. Concentration/decision-making:','','','N','Y',11,'en',0,0,'1',NULL),(92,0,581341,29,'L','Q1049E11','11. Perception of myself:','','','N','Y',12,'en',0,0,'1',NULL),(93,0,581341,29,'L','Q1049E12','12. Thoughts of my own death or suicide:','','','N','Y',13,'en',0,0,'1',NULL),(94,0,581341,30,'F','Q1051','','','','N','Y',0,'en',0,0,'1',''),(95,0,581341,31,'F','Q1052','','','','N','Y',0,'en',0,0,'1',''),(96,0,581341,32,'F','Q1054','','','','N','Y',0,'en',0,0,'1',''),(97,0,581341,33,'F','Q1056','','','','N','Y',0,'en',0,0,'1',''),(98,0,581341,33,'F','Q1056E','In the past 6 months, has your child showed symptoms of...','','','N','Y',1,'en',0,0,'1',''),(99,0,581341,33,'F','Q1056E1','In the last 6 months, reflect on your child\'s performance...','','','N','Y',2,'en',0,0,'1',''),(100,0,581341,37,'F','Q1042','<p><strong>NIDA Quick Screen Question: </strong></p>\n\n<p><strong><u>In the past year</u>, how often have you used the following?</strong></p>\n','','','N','Y',0,'en',0,0,'1',NULL),(101,0,581341,37,'X','Q1042E','<p> If the patient says <strong>“NO”</strong> for all drugs in the Quick Screen, reinforce abstinence. <strong>Screening is complete</strong>.</p>\n\n<p> If the patient says <strong>“Yes” to one or more days of heavy drinking</strong>, patient is an at-risk drinker. Please see NIAAA website “How to Help Patients Who Drink Too Much: A Clinical Approach” http://pubs.niaaa.nih.gov/publications/Practitioner/CliniciansGuide2005/clinician _guide.htm, for information to <strong>Assess, Advise, Assist</strong>, and Arrange help for at risk drinkers or patients with alcohol use disorders</p>\n\n<p> If patient says <strong>“Yes” to use of tobacco:</strong> Any current tobacco use places a patient at risk. Advise all tobacco users to quit. For more information on smoking cessation, please see “Helping Smokers Quit: A Guide for Clinicians” http://www.ahrq.gov/clinic/tobacco/clinhlpsmksqt.htm</p>\n\n<p> If the patient says <strong>“Yes”</strong> to <strong>use of illegal drugs or prescription drugs for non-medical reasons</strong>, proceed to <strong>Question 1</strong> of the NIDA-Modified ASSIST.</p>\n','','','N','N',1,'en',0,0,'1',NULL),(102,0,581341,37,'X','Q1042E1','<p>Questions 1-8 of the NIDA-Modified ASSIST V2.0</p>\n\n<p><strong>Instructions:</strong> Patients may fill in the following form themselves but screening personnel should offer to read the questions aloud in a private setting and complete the form for the patient. To preserve confidentiality, a protective sheet should be placed on top of the questionnaire so it will not be seen by other patients after it is completed but before it is filed in the medical record.</p>\n','','','N','N',2,'en',0,0,'1',NULL),(103,0,581341,37,'F','Q1042E2','<p>Question 1 of 8, NIDA-Modified ASSIST</p>\n\n<p>In your<strong><em> LIFETIME</em></strong>, which of the following substances have you ever used?</p>\n\n<p><em><strong>*Note for Physicians: For prescription medications, please report nonmedical use only.</strong></em></p>\n','','','N','Y',3,'en',0,0,'1',''),(104,0,581341,37,'X','Q1042E3','<p> Given the patient’s response to the Quick Screen, the patient should not indicate <strong>“NO”</strong> for all drugs in Question 1. If they do, remind them that their answers to the Quick Screen indicated they used an illegal or prescription drug for nonmedical reasons within the past year and then <strong>repeat Question 1</strong>. If the patient indicates that the drug used is not listed, please mark <strong>‘Yes’</strong> next to ‘Other’ and continue to <strong>Question 2</strong> of the NIDA-Modified ASSIST.</p>\n\n<p> If the patient says <strong>“Yes”</strong> to any of the drugs, proceed to <strong>Question 2</strong> of the NIDA-Modified ASSIST.</p>\n','','','N','N',4,'en',0,0,'1',NULL),(105,0,581341,37,'F','Q1042E4','<p><strong>Question 2 of 8, NIDA-Modified ASSIST </strong></p>\n\n<p><strong>2. <u>In the past three months</u>, how often have you used the substances you mentioned (first drug, second drug, etc)?</strong></p>\n','','','N','Y',5,'en',0,0,'1',''),(106,0,581341,37,'X','Q1042E5','<p> For patients who report <strong>“Never”</strong> having used any drug in the past 3 months: <strong>Go to Questions 6-8. </strong></p>\n\n<p> For any recent <strong>illicit or nonmedical prescription drug use</strong>, go to <strong>Question 3.</strong></p>\n','','','N','N',6,'en',0,0,'1',NULL),(107,0,581341,37,'F','Q1042E6','<strong>3. <u>In the past 3 months</u>, how often have you had a strong desire or urge to use (first drug, second drug, etc)?</strong>','','','N','Y',7,'en',0,0,'1',''),(108,0,581341,37,'F','Q1042E7O','<strong>4. <u>During the past 3 months</u>, how often has your use of (first drug, second drug, etc) led to health, social, legal or financial problems?</strong>','','','N','Y',8,'en',0,0,'1',''),(109,0,581341,37,'F','Q1042E8','<strong>5. <u>During the past 3 months</u>, how often have you failed to do what was normally expected of you because of your use of (first drug, second drug, etc)?</strong>','','','N','Y',9,'en',0,0,'1',''),(110,0,581341,37,'X','Q1042E9','<strong>Instructions:</strong> Ask Questions 6 & 7 for all substances ever used (i.e., those endorsed in the Question 1).','','','N','N',10,'en',0,0,'1',NULL),(111,0,581341,37,'F','Q1042E10','<strong>6. Has a friend or relative or anyone else <u>ever</u> expressed concern about your use of (first drug, second drug, etc)?</strong>','','','N','Y',11,'en',0,0,'1',''),(112,0,581341,37,'F','Q1042E11','<strong>7. Have you ever tried and failed to control, cut down or stop using (first drug, second drug, etc)?</strong>','','','N','Y',12,'en',0,0,'1',''),(113,0,581341,37,'L','Q1042E12','<strong>8. Have you ever used any drug by injection (NONMEDICAL USE ONLY)?</strong>','','','N','Y',13,'en',0,0,'1',NULL),(114,0,581341,37,'X','Q1042E13','<p> Recommend to patients reporting any prior or current intravenous drug use that they get tested for HIV and Hepatitis B/C.</p>\n\n<p> If patient reports using a drug by injection in the past three months, ask about their pattern of injecting during this period to determine their risk levels and the best course of intervention.</p>\n\n<ul>\n	<li>o If patient responds that they inject once weekly or less OR fewer than 3 days in a row, provide a brief intervention including a discussions of the risks associated with injecting.</li>\n	<li>o If patient responds that they inject more than once per week OR 3 or more days in a row, refer for further assessment.<br />\n	 </li>\n</ul>\n\n<p><strong>Note:</strong> Recommend to patients reporting any current use of alcohol or illicit drugs that they get tested for HIV and other sexually transmitted diseases.</p>\n','','','N','N',14,'en',0,0,'1',NULL),(115,0,581341,37,'X','Q1042E14','<p><strong>Tally Sheet for scoring the full NIDA-Modified ASSIST: </strong></p>\n\n<hr />\n<p><strong>Instructions:</strong> For each substance (labeled a–j), add up the scores received for questions 2-7 above. This is the Substance Involvement (SI) score. Do not include the results from either the Q1 or Q8 (above) in your SI scores.</p>\n','','','N','N',15,'en',0,0,'1',NULL),(116,0,581341,37,'K','Q1042E15','<strong>Substance Involvement Score Total (SI SCORE)</strong>','','','N','Y',16,'en',0,0,'1',''),(117,0,581341,38,'L','Q1047','<p style=\"margin-left:13.7pt;\">1.   How many panic and limited symptoms attacks did you have during the past week?</p>\n','','','N','Y',0,'en',0,0,'1',NULL),(118,0,581341,38,'L','Q1047E','<p style=\"margin-left:13.7pt;\">2.   If you had any panic attacks during the past week, how distressing (uncomfortable, frightening) were they <u>while they were happening</u>? (If you had more than one, give an average rating. If you didn’t have any panic attacks but did have limited symptom attacks, answer for the limited symptom attacks.)</p>\n','','','N','Y',1,'en',0,0,'1',NULL),(119,0,581341,38,'L','Q1047E1','<p style=\"margin-left:13.7pt;\">3.   During the past week, how much have you worried or felt anxious <u>about when your next panic attack would occur, or about fears related to the attacks</u> (for example, that they could mean you have physical or mental health problems or could cause you social embarrassment)?</p>\n','','','N','Y',2,'en',0,0,'1',NULL),(120,0,581341,38,'L','Q1047E2','<p style=\"margin-left:13.7pt;\">4.   During the past week, were there any <u>places or situations</u> (e.g., public transportation, movie theaters, crowds, bridges, tunnels, shopping malls, being alone) you avoided, or felt afraid of (uncomfortable in, wanted to avoid or leave), <u>because of fear of having a panic attack</u>? Are there any other situations that you would have avoided or been afraid of if they had come up during the week, for the same reason? If yes to either question, please rate your level of fear and avoidance this past week.</p>\n','','','N','Y',3,'en',0,0,'1',NULL),(121,0,581341,38,'L','Q1047E4','<p style=\"margin-left:13.5pt;\">5.   During the past week, were there any <u>activities</u> (e.g., physical exertion, taking a hot shower or bath, drinking coffee, watching an exciting or scary movie) that you avoided, or felt afraid of (uncomfortable doing, wanted to avoid or stop), <u>because they caused physical sensations like those you feel during panic attacks or that you were afraid might trigger a panic attack</u>? Are there any other activities that you would have avoided or been afraid of if they had come up during the week, for that reason? If yes to either question, please rate your level of fear and avoidance of those activities this past week.</p>\n','','','N','Y',4,'en',0,0,'1',NULL),(122,0,581341,38,'L','Q1047E5','<p style=\"margin-left:13.7pt;\">6.   During the past week, how much did the above symptoms altogether (panic and limited symptom attacks, worry about attacks, and fear of situations and activities because of attacks), interfere with your <u>ability to work, go to school, or carry out your responsibilities at home</u>? (If your work or home responsibilities were less than usual this past week, answer how you think you would have done if the responsibilities had been usual.)</p>\n','','','N','Y',5,'en',0,0,'1',NULL),(123,0,581341,38,'L','Q1047E6','<p style=\"margin-left:13.7pt;\">7.   During the past week, how much did panic and limited symptom attacks, worry about attacks, and fear of situations and activities because of attacks, interfere with your <u>social life</u>? (If you didn’t have many opportunities to socialize this past week, answer how you think you would have done if you did have opportunities.)</p>\n','','','N','Y',6,'en',0,0,'1',NULL),(124,0,581341,39,'L','Q1043C1S01S01','<p><strong>P1. Delusions</strong></p>\n\n<p>Beliefs which are unfounded, unrealistic, and idiosyncratic.</p>\n\n<p>Basis for rating: Thought content expressed in the interview and its influence on social relations and behavior.</p>\n','','','N','Y',0,'en',0,0,'1',''),(125,0,581341,39,'L','Q1043C1S01S02','<p><strong>P2. Conceptual disorganization </strong></p>\n\n<p>Disorganized process of thinking characterized by disruption of goal-directed sequencing, e.g., circumstantiality, tangentiality, loose associations non sequiturs, gross illogicality, or thought block.</p>\n\n<p>Basis for rating: Cognitive-verbal processes observed during the course of interview.</p>\n','','','N','Y',1,'en',0,0,'1',''),(126,0,581341,39,'L','Q1043C1S01S03','<p><strong>P3. Hallucinatory behavior </strong></p>\n\n<p>Verbal report or behavior indicating perceptions which are not generated by external stimuli. These may occur in the auditory visual, olfactory, or somatic realms.</p>\n\n<p>Basis for rating: Verbal report and physical manifestations during the course of interview as well as reports of behavior by primary care workers or family.</p>\n','','','N','Y',2,'en',0,0,'1',''),(127,0,581341,39,'L','Q1043C1S01S04','<p><strong>P4. Excitement</strong></p>\n\n<p>Hyperactivity as reflected in accelerated motor behavior, heightened responsivity to stimuli hypervigilance, or excessive mood lability.</p>\n\n<p>Basis for rating: Behavioral manifestations during the course of interview as well as reports of behavior by primary care workers or family.</p>\n','','','N','Y',3,'en',0,0,'1',''),(128,0,581341,39,'L','Q1043C1S01S05','<p><strong>P5. Grandiosity </strong></p>\n\n<p>Exaggerated self-opinion and unrealistic convictions of superiority, including delusions of extraordinary abilities, wealth, knowledge, fame, power, and moral righteousness.</p>\n\n<p>Basis for rating: Thought content expressed in the interview and its influence on behavior.</p>\n','','','N','Y',4,'en',0,0,'1',''),(129,0,581341,39,'L','Q1043C1S01S06','<p><strong>P6. Suspiciousness/persecution </strong></p>\n\n<p>Unrealistic or exaggerated ideas of persecution, as reflected in guardedness, a distrustful attitude, suspicious hypervigilance, or frank delusions that others mean one harm.</p>\n\n<p>Basis for rating: Thought content expressed in the interview and its influence on behavior.</p>\n','','','N','Y',5,'en',0,0,'1',''),(130,0,581341,39,'L','Q1043C1S01S07','<p><strong>P7. Hostility</strong></p>\n\n<p>Verbal and nonverbal expressions of anger and resentment, including sarcasm, passive-aggressive behavior, verbal abuse, and assaultiveness.</p>\n\n<p>Basis for rating: Interpersonal behavoir observed during the interview and reports by primary care workers or family.</p>\n','','','N','Y',6,'en',0,0,'1',''),(131,0,581341,39,'L','Q1043C1S02S01','<p><strong>N1. Blunted affect </strong></p>\n\n<p>Diminished emotional responsiveness as characterized by a reduction in facial expression, modulation of feelings, and communicative gestures.</p>\n\n<p>Basis for rating: Observation of physical manifestations of affective tone and emotional responsiveness during the course of interview.</p>\n','','','N','Y',8,'en',0,0,'1',''),(132,0,581341,39,'L','Q1043C1S02S02','<p><strong>N2. Emotional withdrawal </strong></p>\n\n<p>Lack of interest in, involvement with, and affective commitment to life\'s events.</p>\n\n<p>Basis for rating: Reports of functioning from primary care workers or family and observation of interpersonal behavoir during the course of interview.</p>\n','','','N','Y',9,'en',0,0,'1',''),(133,0,581341,39,'L','Q1043C1S02S03','<p><strong>N3. Poor rapport </strong></p>\n\n<p>Lack of interpersonal empathy, openess in conversation, and sense of closeness, interest, or involvement with the interviewer. This is evidenced by interpersonal distancing and reduced verbal and nonverbal communication.</p>\n\n<p>Basis for rating: Interpersonal behavior during the course of interview.</p>\n','','','N','Y',10,'en',0,0,'1',''),(134,0,581341,39,'L','Q1043C1S02S04','<p><strong>N4. Passive/apathetic social withdrawal </strong></p>\n\n<p>Diminished interest and initiative in social interactions due to passivity, apathy, anergy, or avolition. This leads to reduced interpersonal involvement and neglect of activities of daily living.</p>\n\n<p>Basis for rating: Reports on social behavior from primary care workers or family.</p>\n','','','N','Y',11,'en',0,0,'1',''),(135,0,581341,39,'L','Q1043C1S02S05','<p><strong>N5. Difficulty in abstract thinking </strong></p>\n\n<p>Impairment in the use of the abstract-symbolic mode of thinking, as evidenced by difficulty in classification, forming generalizations, and proceeding beyond concrete or egocentric thinking in problemsolving tasks.</p>\n\n<p>Basis for rating: Responses to questions on similarities and proverb interpretation, and use of concrete vs. abstract mode during the course of the interview.</p>\n','','','N','Y',12,'en',0,0,'1',''),(136,0,581341,39,'L','Q1043C1S02S06','<p><strong>N6. Lack of spontaneity and flow of conversation </strong></p>\n\n<p>Reduction in the normal flow of communication associated with apathy, avolition, defensiveness, or cognitive deficit. This is manifested by diminished fluidity and productivity of the verbal-interactional process. Basis for rating: cognitive-verbal processes observed during the course of interview.</p>\n','','','N','Y',13,'en',0,0,'1',''),(137,0,581341,39,'L','Q1043C1S02S07','<p><strong>N7. Stereotyped thinking </strong></p>\n\n<p>Decreased fluidity, spontaneity, and flexibility of thinking, as evidenced in rigid, repetitious, or barren thought content.</p>\n\n<p>Basis for rating: Cognitive-verbal processes observed during the interview.</p>\n','','','N','Y',14,'en',0,0,'1',''),(138,0,581341,39,'L','Q1043C1S03S01','<p><strong>G1. Somatic concern</strong></p>\n\n<p>Physical complaints or beliefs about bodily illness or malfunctions. This may range from a vague sense of ill being to clear-cut delusions of catastrophic physical disease.</p>\n\n<p>Basis for rating: Thought content expressed in the interview.</p>\n','','','N','Y',16,'en',0,0,'1',''),(139,0,581341,39,'L','Q1043C1S03S02','<p><strong>G2. Anxiety </strong></p>\n\n<p>Subjective experience of nervousness, worry, apprehension, or restlessness, ranging from e xcessive concern about the present or future to feelings of panic.</p>\n\n<p>Basis for rating: Verbal report during the course of interview and corresponding physical manifestations.</p>\n','','','N','Y',17,'en',0,0,'1',''),(140,0,581341,39,'L','Q1043C1S03S03','<p><strong>G3. Guilt Feelings </strong></p>\n\n<p>Sense of remorse or self-blame for real or imagined misdeeds in the past.</p>\n\n<p>Basis for rating: Verbal report of guilt feelings during the course of interview and the influence on attitudes and thoughts.</p>\n','','','N','Y',18,'en',0,0,'1',''),(141,0,581341,39,'L','Q1043C1S03S04','<p><strong>G4. Tension</strong></p>\n\n<p>Overt physical manifestations of fear, anxiety, and agitation, such as stiffness, tremor, profuse sweating, and restlessness.</p>\n\n<p>Basis for rating: Verbal report attesting to anxiety and, thereupon, the severity of physical manifestations of tension observed during the interview.</p>\n','','','N','Y',19,'en',0,0,'1',''),(142,0,581341,39,'L','Q1043C1S03S05','<p><strong>G5. Mannerisms and posturing </strong></p>\n\n<p>Unnatural movements or posture as characterized by an awkward, stilted, disorganized, or bizarre appearance.</p>\n\n<p>Basis for rating: Observation of physical manifestations during the course of interview as well as reports from primary care workers or family.</p>\n','','','N','Y',20,'en',0,0,'1',''),(143,0,581341,39,'L','Q1043C1S03S06','<p><strong>G6. Depression </strong></p>\n\n<p>Feelings of sadness, discouragement, helplessness, and pessimism.</p>\n\n<p>Basis for rating: Verbal report of depressed mood during the course of interview and its observed influence on attitude and behavior.</p>\n','','','N','Y',21,'en',0,0,'1',''),(144,0,581341,39,'L','Q1043C1S03S07','<p><strong>G7. Motor retardation </strong></p>\n\n<p>Reduction in motor activity as reflected in slowing or lessening of movements and speech, diminished responsiveness to stimuli, and reduced body tone.</p>\n\n<p>Basis for rating: Manifestations during the course of interview as well as reports by primary care workers or family.</p>\n','','','N','Y',22,'en',0,0,'1',''),(145,0,581341,39,'L','Q1043C1S03S08','<p><strong>G8. Uncooperativeness </strong></p>\n\n<p>Active refusal to comply with the will of significant others, including the interviewer, hospital staff, or family, which may be associated with distrust, defensiveness, stubbornness, negativism, rejection of authority, hostility, or belligerence.</p>\n\n<p>Basis for rating: Interpersonal behavior observed during the course of interview as well as reports by primary care workers or family.</p>\n','','','N','Y',23,'en',0,0,'1',''),(146,0,581341,39,'L','Q1043C1S03S09','<p><strong>G9. Unusual thought content </strong></p>\n\n<p>Thinking characterized by strange, fantastic, or bizarre ideas, ranging from those which are remote or atypical to those which are distorted, illogical, and patently absurd.</p>\n\n<p>Basis for rating: Thought content expressed during the course of interview.</p>\n','','','N','Y',24,'en',0,0,'1',''),(147,0,581341,39,'L','Q1043C1S03S10','<p><strong>G10. Disorientation </strong></p>\n\n<p>Lack of awareness of one\'s relationship to the milieu, including persons, place, and time, which may be due to confusion or withdrawal.</p>\n\n<p>Basis for rating: Responses to interview questions on orientation.</p>\n','','','N','Y',25,'en',0,0,'1',''),(148,0,581341,39,'L','Q1043C1S03S11','<p><strong>G11. Poor attention </strong></p>\n\n<p>Failure in focused alertness manifested by poor concentration, distractibility from internal and external stimuli, and difficulty in harnessing, sustaining, or shifting focus to new stimuli.</p>\n\n<p>Basis for rating: Manifestations during the course of interview.</p>\n','','','N','Y',26,'en',0,0,'1',''),(149,0,581341,39,'L','Q1043C1S03S12','<p><strong>G12. Lack of judgment and insight</strong></p>\n\n<p>Impaired awareness or understanding of one\'s own psychiatric condition and life situation. This is evidenced by failure to recognize past or present psychiatric illness or symptoms, denial of need for psychiatric hospitalization or treatment, decisions characterized by poor anticipation of consequences, and unrealistic short-term and long-range planning.</p>\n\n<p>Basis for rating: Thought content expressed during the interview.</p>\n','','','N','Y',27,'en',0,0,'1',''),(150,0,581341,39,'L','Q1043C1S03S13','<p><strong>G13. Disturbance of volition </strong></p>\n\n<p>Disturbance in the wilful initiation, sustenance, and control of one\'s thoughts, behavior, movements, and speech.</p>\n\n<p>Basis for rating: Thought content and behavior manifested in the course of interview.</p>\n','','','N','Y',28,'en',0,0,'1',''),(151,0,581341,39,'L','Q1043C1S03S14','<p><strong>G14. Poor impulse control</strong></p>\n\n<p>Disordered regulation and control of action on inner urges resulting in sudden, unmodulated, arbitrary, o; misdirected discharge of tension and emotions without concern about consequences.</p>\n\n<p>Basis for rating: Behavior during the course of interview and reported by primary care workers or family.</p>\n','','','N','Y',29,'en',0,0,'1',''),(152,0,581341,39,'L','Q1043C1S03S15','<p><strong>G15. Preoccupation </strong></p>\n\n<p>Absorption with internally generated thoughts and feelings and with autistic experiences to the detriment of reality orientation and adaptive behavior.</p>\n\n<p>Basis for rating: Interpersonai behavior observed during the course of interview.</p>\n','','','N','Y',30,'en',0,0,'1',''),(153,0,581341,39,'L','Q1043C1S03S16','<p><strong>G16. Active social avoidance </strong></p>\n\n<p>Diminished social involvement associated with unwarranted fear, hostility, or distrust.</p>\n\n<p>Basis for rating: Reports of social functioning by primary care workers or family.</p>\n','','','N','Y',31,'en',0,0,'1',''),(154,0,581341,40,'L','Q1058C1S01','<strong>1. Elevated Mood</strong>','','','N','Y',0,'en',0,0,'1',''),(155,0,581341,40,'L','Q1058C1S02','<strong>2. Increased Motor Activity/Energy</strong>','','','N','Y',1,'en',0,0,'1',''),(156,0,581341,40,'L','Q1058C1S03','<strong>3. Sexual Interest</strong>','','','N','Y',2,'en',0,0,'1',''),(157,0,581341,40,'L','Q1058C1S04','<strong>4. Sleep</strong>','','','N','Y',3,'en',0,0,'1',''),(158,0,581341,40,'L','Q1058C1S05','<strong>5. Irritability</strong>','','','N','Y',4,'en',0,0,'1',''),(159,0,581341,40,'L','Q1058C1S06','<strong>6. Speech (Rate and Amount)</strong>','','','N','Y',5,'en',0,0,'1',''),(160,0,581341,40,'L','Q1058C1S07','<strong>7. Language/Thought Disorder</strong>','','','N','Y',6,'en',0,0,'1',''),(161,0,581341,40,'L','Q1058C1S08','<strong>8. Thought Content</strong>','','','N','Y',7,'en',0,0,'1',''),(162,0,581341,40,'L','Q1058C1S09','<strong>9. Disruptive/Aggressive Behavior</strong>','','','N','Y',8,'en',0,0,'1',''),(163,0,581341,40,'L','Q1058C1S10','<strong>10. Appearance</strong>','','','N','Y',9,'en',0,0,'1',''),(164,0,581341,40,'L','Q1058C1S11','<strong>11. Insight</strong>','','','N','Y',10,'en',0,0,'1',''),(165,0,581341,41,'F','Q1035','<strong>On how many of the past 28 days …..</strong>','','','N','Y',0,'en',0,0,'1',''),(166,0,581341,41,'X','Q1035E','<strong>Questions 13-18: Please fill in the appropriate number in the boxes on the right. Remember that the questions only refer to the past four weeks (28 days).</strong>','','','N','N',1,'en',0,0,'1',NULL),(167,0,581341,41,'K','Q1035E1','<strong>Over the past four weeks (28 days) ……</strong>','','','N','Y',2,'en',0,0,'1',NUL