,'',''),(853,199,581341,34,'T','06','Have you done anything, started to do anything, or prepared to do anything to end your life? Examples: Collected pills, obtained a gun, gave away valuables, wrote a will or suicide note, took out pills but didn’t swallow any, held a gun but changed your mind or it was grabbed from your hand, went to the roof but didn’t jump; or actually took pills, tried to shoot yourself, cut yourself, tried to hang yourself, etc.',NULL,NULL,'N','N',1,'en',0,0,'1',''),(854,202,581341,35,'T','01','Have you wished you were dead or wished you could go to sleep and not wake up?',NULL,NULL,'N','N',1,'en',0,0,'1',''),(855,202,581341,35,'T','02','Have you actually had any thoughts about killing yourself?',NULL,NULL,'N','N',2,'en',0,0,'',''),(856,203,581341,35,'T','03','Have you thought about how you might do this?',NULL,NULL,'N','N',1,'en',0,0,'1',''),(857,203,581341,35,'T','04','Have you had any intention of acting on these thoughts of killing yourself, as opposed to you have the thoughts but you definitely would not act on them?',NULL,NULL,'N','N',2,'en',0,0,'',''),(858,203,581341,35,'T','05','Have you started to work out or worked out the details of how to kill yourself? Do you intend to carry out this plan?',NULL,NULL,'N','N',3,'en',0,0,'',''),(859,204,581341,35,'T','06','Have you done anything, started to do anything, or prepared to do anything to end your life? Examples: Collected pills, obtained a gun, gave away valuables, wrote a will or suicide note, took out pills but didn’t swallow any, held a gun but changed your mind or it was grabbed from your hand, went to the roof but didn’t jump; or actually took pills, tried to shoot yourself, cut yourself, tried to hang yourself, etc.',NULL,NULL,'N','N',1,'en',0,0,'1',''),(860,0,581341,43,'S','Q8001','Name:','','','N','Y',2,'en',0,0,'1',NULL),(861,0,581341,43,'S','Q8002','I am a patient of','','Your provider','N','Y',3,'en',0,0,'1',NULL),(862,0,581341,43,'X','Q8003','','','<p><span style=\"color:#000000;\">My provider has informed me that he/she recommends that I receive psychotherapy for the treatment of my illness or problems. He/she has informed me of the nature of the treatment and has explained to me the benefits and risks as well as alternative approaches for care (including psychotropic medication, if clinically appropriate).</span></p>\n\n<p><span style=\"color:#000000;\">I understand that although my provider has explained the treatment to me, there may be problems that develop. I understand that it is my<br />\nresponsibility to inform my provider (or a member of his/her staff if s/he is<br />\nunavailable) if there are any unexpected changes in my condition or if any problems arise relating to my treatment.</span></p>\n\n<p><span style=\"color:#000000;\">I understand that I am not compelled to engage in psychotherapy and that I may decide to stop it at any time. It is my responsibility to notify my provider if I do decide to terminate treatment.</span></p>\n\n<p><span style=\"color:#000000;\">I also understand that, although my provider believes that<br />\npsychotherapy will help me, there is no guarantee that my condition will improve.</span></p>\n\n<p><span style=\"color:#000000;\">On this basis, I authorize <strong>Avicenna Behavioral Health</strong> to provide<br />\npsychotherapy at such intervals as he/she deems advisable.</span></p>\n','N','N',4,'en',0,0,'1',''),(863,0,581341,43,'_','Q8004','Your sign','','','N','Y',5,'en',0,0,'1',NULL),(864,0,581341,43,'D','Q8005','Date','','','N','Y',6,'en',0,0,'1',NULL),(865,0,581341,43,'X','Q8006','<p>NOTICE OF PRIVACY PRACTICES</p>\n\n<p>Avicenna Behavioral Health 920 N York Rd, #200, Hinsdale, IL 60521. Tel: 630-749-1344. Fax: 708-290-0784 E mail: contact@avicennabh.com</p>\n\n<p>Office contact person: Mary Radavic</p>\n\n<p>Effective date of notice: August,1st 2019<br />\nTHIS NOTICE DESCRIBES HOW MEDICAL INFORMATION ABOUT YOU MAY BE USED AND DISCLOSED AND HOW YOU CAN GET ACCESS</p>\n\n<p>TO THIS INFORMATION. PLEASE REVIEW IT CAREFULLY.</p>\n\n<p>We respect our legal obligation to keep health information that identifies you private. We are obligated by law to give you notice of our privacy practices.<br />\nThis Notice describes how we protect your health information and what rights you have regarding it. If you want more information about our privacy practices,<br />\ncall or visit the office contact person at the address or phone number shown at the beginning of this Notice.<br />\nTREATMENT, PAYMENT, AND HEALTH CARE OPERATIONS</p>\n\n<p>The most common reason why we use or disclose your health information is for treatments (examples: setting up an appointment for you; medical and psychiatric<br />\nexamination; prescribing medications and requesting them to be filled; referring you to another doctor or clinic; or getting copies of your health information from<br />\nanother professional that you may have seen before us; reminding you of scheduled appointments, or that it is time to make a routine appointment by calling, emailing,<br />\ntexting or writing to remind you; notifying you of other treatments or services available at our office that might help you), for payments (Example: asking you about<br />\nyour health/vision care plans or other sources of payment; preparing and sending bills or claims; and collecting unpaid amounts either ourselves or through a collection<br />\nagency or attorney) or for health care operations (examples: financial or billing audits; internal quality assurance; personnel decisions; participation in managed care<br />\nplans; defense of legal matters; business planning; and outside storage of our records). We routinely use your health information inside our office for there purposes<br />\nwithout any special permission. If we need to disclose your health information outside of our office for these reasons, we will ask you for special written permission. If<br />\nyou think that we have not properly respected the privacy of your health information, you are free to complain to the U.S. Department of Health and Human Services,<br />\nOffice for Civil Rights, or to us by sending a written complaint to the office contact person above. If you prefer, you can discuss your complaint in person or by phone.<br />\nWe will not retaliate against you if you make a complaint.</p>\n\n<p>USES AND DISCLOSURES FOR OTHER REASONS WITHOUT PERMISSION</p>\n\n<p>In some limited situations, the law allows or requires us to use or disclose your health information without your permission. Not these situations will apply to us;<br />\nsome may never come up at our office at all. Such uses or disclosures are:<br />\n• when a state or federal law mandates that certain health information be reported for a specific purpose;<br />\n• for public health purposes, such as contagious disease reporting, investigation or surveillance; and notices to and from the U.S. Food and Drug<br />\nAdministration regarding drugs or medical devices;<br />\n• disclosures to governmental authorities about victims of suspected abuse, neglect, or domestic violence;<br />\n• uses and disclosures for health oversight activities, such as for the licensing of doctors; for audits by Medicare or Medicaid; or for investigation of possible<br />\nviolations of health care laws;<br />\n• disclosures for judicial and administrative proceedings, such as in response to subpoenas or orders of courts or administrative agencies;<br />\n• disclosures for law enforcement purposes, such as to provide information about someone who is or is suspected to be a victim of a crime; to provide<br />\ninformation about a crime at our office; or to report a crime that happened somewhere else;<br />\n• disclosure to a medical examiner to identify a dead person or to determine the cause of death; or to funeral directors to aid in burial; or to organizations that<br />\nhandle organ tissue donations;<br />\n• uses or disclosures for health-related research;<br />\n• uses and disclosures to prevent a serious threat to health or safety;<br />\n• uses or disclosures for specialized government functions, such as for the protection of the president or high ranking government officials; for lawful national<br />\nintelligence activities; for military purposes; or for the evaluation and health of members of the foreign service;<br />\n• disclosures of de-identified information;<br />\n• disclosures relating to worker’s compensation programs;<br />\n• disclosures of a “limited data set” for research, public health, or health care operations;<br />\n• incidental disclosures that are an unavoidable by-product of permitted uses or disclosures;<br />\n• disclosures to “business associates” who perform health care operations for us and who commit to respect the privacy of your health information;<br />\nUnless you object, we will also share relevant information about your care with your family or friends who are helping you with your eye care.<br />\nOTHER USES AND DISCLOSURES: We will not make any other uses or disclosures of your health information unless you sign a written “authorization form.” The<br />\ncontent of an “authorization form” is determined by federal law. Sometimes, we may initiate the authorization process if the use or disclosure is our idea. Sometimes,<br />\nyou may initiate the process if it’s your idea for us to send your information to someone else. Typically, in this situation you will give us a properly completed<br />\nauthorization form, or you can use one of ours. If we initiate the process and ask you to sign an authorization form, you do not have to sign it. If you do not sign the<br />\nauthorization, we cannot make the use or disclosure. If you do sign one, you may revoke it at any time unless we have already acted in reliance upon it. Revocations<br />\nmust be in writing. Send them to the office contact person named above. By law, we must abide by the terms of this Notice until we choose to change it. We reserve the<br />\nright to change this notice at any time as allowed by law. If we change this Notice, we will post the new one in our office and have copies available in our office, and<br />\nthe new privacy practices will apply to your health information that we already have as well as to such information that we may generate in the future.<br />\nYOUR RIGHTS REGARDING YOUR HEALTH INFORMATION: The law gives you many rights regarding your health information. You can:<br />\n• Ask us to restrict our uses and disclosures for purposes of treatment (except emergency treatment), payment or health care operations. We do not have to agree to<br />\ndo this, but if we agree, we must honor the restrictions that you want. To ask for a restriction, send a written request to the office contact person at the address, fax<br />\nor E Mail shown at the beginning of this Notice.<br />\n• Ask us to communicate with you in a confidential way, such as by phoning you at work rather than home, by mailing health information to a different address, or<br />\nby using E mail to your personal E Mail address. We will accommodate these requests if they are reasonable, and if you pay us for any extra cost. If you want to<br />\nask for confidential communications, send a written request to the office contact person at the address, fax or E mail shown at the beginning of this Notice.<br />\n• Ask to see or to get photocopies of your health information. By law, there are a few limited situations in which we can refuse to permit access or copying. For the</p>\n\n<p>most part, however, you will be able to review or have a copy of your health information within 30 days of asking us (or sixty days if the information is stored off-<br />\nsite). You may have to pay for photocopies in advance. If we deny your request, we will send you a written explanation, and instructions about how to get an</p>\n\n<p>impartial review of our denial if one is legally available. By law, we can have one 30-day extension of the time for us to give you access or photocopies if we send<br />\nyou a written notice of the extension. If you want to review or get photocopies of your health information, send a written request to the office contact person at the<br />\naddress, fax or E mail shown above<br />\n• Ask us to amend your health information if you think that it is incorrect or incomplete. If we agree, we will amend the information within 60 days from when you<br />\nask us. We will send the corrected information to persons who we know got the wrong information, and others that you specify. If we do not agree, you can write<br />\na statement of your position, and we will include it with your health information along with any rebuttal statement that we may write. Once your statement of<br />\nposition and/or our rebuttal is included in your health information, we will send it along whenever we make a permitted disclosure of your health information. By<br />\nlaw, we can have one 30-day extension of time to consider a request for amendment if we notify you in writing of the extension. If you want to ask us to amend<br />\nyour health information, send a written request, including your reasons for the amendment, to the office contact person at the address, fax or E mail shown above<br />\n• Get a list of the disclosures that we have made of your health information within the past three years. By law, the list will not include: disclosures for purposes of<br />\ntreatment, payment or health care operations; disclosures with your authorization; incidental disclosures; disclosures required by law; and some other limited<br />\ndisclosures. You are entitled to one such list per year without charge. If you want more frequent lists, you must pay for them in advance. We will usually respond<br />\nto your request within 60 days of receiving it, but by law we can have one 30-day extension of time if we notify you of the extension in writing. If you want a list,<br />\nsend a written request to the office contact person above.<br />\n• Get additional paper copies of this Notice of Privacy Practices upon request. It does not matter whether you got one electronically or in paper form already. If you<br />\nwant additional paper copies, send a written request to the office contact person at the address, fax, or E mail shown above.</p>\n','','','N','N',7,'en',0,0,'1',NULL),(866,0,581341,44,'S','Q8010','Patient name','','','N','Y',1,'en',0,0,'1',NULL),(867,0,581341,44,'D','Q8011','Date of birth','','','N','Y',2,'en',0,0,'1',''),(868,0,581341,44,'S','Q8012','Patient address','','','N','Y',3,'en',0,0,'1',NULL),(869,0,581341,44,'S','Q8013','Patient phone number','','','N','Y',4,'en',0,0,'1',NULL),(870,0,581341,44,'X','Q8014','','','<span style=\"color:#000000;\">I authorize the professional office of named above to release health information identifying me. I understand that “The information authorized for release may include records which may indicate the presence of a communicable or venereal disease which may include, but is not limited to, hepatitis, syphilis, gonorrhea, and the human immunodeficiency virus, also known as Acquired Immune Deficiency Syndrome (AIDS).” under the following terms and conditions:</span>','N','N',5,'en',0,0,'1',NULL),(871,0,581341,44,'S','Q8015','1. Detailed description of the information to be released:','','','N','Y',6,'en',0,0,'1',''),(872,0,581341,44,'S','Q8016','2. To whom may the information be released [name(s) or class(es) of recipients]:','','','N','Y',7,'en',0,0,'1',NULL),(873,0,581341,44,'S','Q8017','3. The purpose(s) for the release:','','(if the authorization is initiated by the individual, it is permissible to state “at the request of the individual” as the purpose, if desired by the individual)','N','Y',8,'en',0,0,'1',''),(874,0,581341,44,'S','Q8018','4. Expiration date or event relating to the individual or purpose for the release:','','','N','Y',9,'en',0,0,'1',NULL),(875,0,581341,44,'X','Q8019','','','<p><span style=\"color:#000000;\">It is completely your decision whether or not the sign this authorization form. We cannot refuse to treat you if you choose not to sign this authorization.</span></p>\n\n<p><span style=\"color:#000000;\">If you sign this authorization, you can revoke it later. The only exception to your right to revoke is if we have already acted in reliance upon the authorization. If you want to revoke your authorization, send us a written or electronic note telling us that your authorization is revoked. Send this note to the office contact person listed at the top of this form.</span></p>\n\n<p><span style=\"color:#000000;\">When your health information is disclosed as provided in this authorization, the recipient often has no legal duty to protect its confidentiality. In many cases, the recipient may re-disclose the information as he/she wishes. Sometimes, state or federal law changes this possibility.</span></p>\n\n<p> </p>\n\n<p><span style=\"color:#000000;\">I HAVE READ AND UNDERSTAND THIS FORM. I AM SIGNING IT VOLUNTARILY. I AUTHORIZE THE DISCLOSURE OF MY HEALTH INFORMATION AS DESCRIBED IN THIS FORM.</span></p>\n','N','N',10,'en',0,0,'1',NULL),(876,0,581341,44,'_','Q8020','Patient Signature','','','N','Y',11,'en',0,0,'1',NULL),(877,0,581341,44,'D','Q8021','Dated','','','N','Y',12,'en',0,0,'1',NULL),(878,0,581341,44,'X','Q8022','','','<p><span style=\"color:#000000;\">If you are signing as a personal representative of the patient, describe your relationship to the patient and the source of your authority to sign this form:</span></p>\n','N','N',13,'en',0,0,'1',''),(879,0,581341,44,'S','Q8023','Relationship to Patient','','','N','N',14,'en',0,0,'1',''),(880,0,581341,44,'S','Q8024','Print Name','','','N','N',15,'en',0,0,'1',''),(881,0,581341,44,'T','Q8025','Source of Authority','','','N','N',16,'en',0,0,'1',''),(882,0,581341,45,'S','Q9090','Patient Name:','','','N','Y',1,'en',0,0,'1',NULL),(883,0,581341,45,'S','Q9091','Medical Record No:','','','N','Y',2,'en',0,0,'1',NULL),(884,0,581341,45,'X','Q9092','','','<ol>\n	<li><span style=\"color:#000000;\">I understand that my health care provider wishes me to engage in a telemedicine consultation.</span></li>\n	<li><span style=\"color:#000000;\">My health care provider has explained to me how the video conferencing technology will be used to affect such a consultation will not be the same as a direct patient/health care provider visit due to the fact that I will not be in the same room as my health care provider.</span></li>\n	<li><span style=\"color:#000000;\">I understand there are potential risks to this technology, including interruptions, unauthorized access and technical difficulties. I understand that my health care provider or I can discontinue the telemedicine consult/visit if it is felt that the videoconferencing connections are not adequate for the situation.</span></li>\n	<li><span style=\"color:#000000;\">I understand that my healthcare information may be shared with other individuals for scheduling and billing purposes. Others may also be present during the consultation other than my health care provider and consulting health care provider in order to operate the video equipment. The above mentioned people will all maintain confidentiality of the information obtained. I further understand that I will be informed of their presence in the consultation and thus will have the right to request the following: (1) omit specific details of my medical history/physical examination that are personally sensitive to me; (2) ask non‐medical personnel to leave the telemedicine examination room: and or (3) terminate the consultation at any time.</span></li>\n	<li><span style=\"color:#000000;\">I have had the alternatives to a telemedicine consultation explained to me, and in choosing to participate in a </span><span style=\"color:#000000;\">telemedicine consultation. I understand that some parts of the exam involving physical tests may be conducted </span><span style=\"color:#000000;\">by individuals at my location at the direction of the consulting health care provider.</span></li>\n	<li><span style=\"color:#000000;\">In an emergent consultation, I understand that the responsibility of the telemedicine consulting specialist is to</span> <span style=\"color:#000000;\">advise my local practitioner and that the specialist’s responsibility will conclude upon the termination of the </span><span style=\"color:#000000;\">video conference connection.</span></li>\n	<li><span style=\"color:#000000;\">I understand that billing will occur from both my practitioner and as a facility fee from the site from which I am</span> <span style=\"color:#000000;\">presented.</span></li>\n	<li><span style=\"color:#000000;\">I have had a direct conversation with my doctor, during which I had the opportunity to ask questions in regard to</span> <span style=\"color:#000000;\">this procedure. My questions have been answered and the risks, benefits and any practical alternatives have</span> <span style=\"color:#000000;\">been discussed with me in a language in which I understand.</span></li>\n</ol>\n\n<p><span style=\"color:#000000;\">By signing this form, I certify:</span></p>\n\n<ul>\n	<li><span style=\"color:#000000;\">That I have read or had this form read and/or had this form explained to me</span></li>\n	<li><span style=\"color:#000000;\">That I fully understand its contents including the risks and benefits of the procedure(s).</span></li>\n	<li><span style=\"color:#000000;\">That I have been given ample opportunity to ask questions and that any questions have been answered to my satisfaction.</span></li>\n</ul>\n','N','N',3,'en',0,0,'1',''),(885,0,581341,45,'_','Q9093','Patient’s/parent/guardian signature','','','N','Y',4,'en',0,0,'1',''),(886,0,581341,45,'_','Q9094','Witness signature','','','N','Y',5,'en',0,0,'1',NULL),(887,0,581341,45,'D','Q9095','Date','','','N','Y',6,'en',0,0,'1',NULL),(888,0,581341,46,'S','Q9002','<b id=\"docs-internal-guid-9ee2d126-7f