INSERT INTO `lime_surveys_languagesettings` VALUES (581341,'en','Default','','<p dir=\"ltr\">Thank you for using QuestionnaireConnect. </p>\r\n\r\n<p dir=\"ltr\">Your provider is requesting your completion of the following questionnaire(s). Please complete within a timely manner. Thank you!</p>\r\n\r\n<p dir=\"ltr\">By clicking next you agree to <a href=\"https://docs.google.com/document/d/e/2PACX-1vRwgLyjiU_ArurMFU1dBF3dxbdw0VoAuJkdzf1kmxOBOlljFJLWi1nQJKeIz5RlwYo-QY5swbHL8tIQ/pub\" target=\"_blank\"> our term and conditions. </a></p>\r\n\r\n<p dir=\"ltr\">Please click <strong>next</strong> to continue. </p>\r\n\r\n<p dir=\"ltr\"> </p>\r\n\r\n<p dir=\"ltr\"> </p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-size:10px;\">*Disclaimer</span></p>\r\n\r\n<p dir=\"ltr\"><span style=\"font-size:10px;\"><b id=\"docs-internal-guid-2b130a09-7fff-97ec-2acc-dff6ad901315\">This online tool is not responsible for the content or clinical use of these questionnaires. This scale was presented based on selection by your doctor. Please contact your provide for any question regarding the use or quality of this content.</b></span></p>\r\n','<p>Thank you for completing your survey. Your provider appreciates your participation.</p>\r\n<a href=\"admin/authentication/sa/login\">Home</a>','','','Invitation to participate in a survey','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>\r\n<p>Dear {FIRSTNAME},<br />\r\n </p>\r\n\r\n<p>Please complete the following questionnaire:<br />\r\n<br />\r\nThe survey is titled:<br />\r\n\"{SURVEYNAME}\"<br />\r\n<br />\r\n\"{SURVEYDESCRIPTION}\"<br />\r\n<br />\r\nTo participate, please click on the link below.<br />\r\n<br />\r\nSincerely,<br />\r\n<br />\r\n{ADMINNAME} ({ADMINEMAIL})<br />\r\n<br />\r\n----------------------------------------------<br />\r\nClick here to do the survey:<br />\r\n{SURVEYURL}<br />\r\n<br />\r\nIf you do not want to participate in this survey and don\'t want to receive any more invitations please click the following link:<br />\r\n{OPTOUTURL}<br />\r\n<br />\r\nIf you are blacklisted but want to participate in this survey and want to receive invitations please click the following link:<br />\r\n{OPTINURL}</p>\r\n</body>\r\n</html>\r\n','Reminder to participate in a survey','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>Dear {FIRSTNAME},<br />\r\n<br />\r\nRecently we invited you to participate in a survey.<br />\r\n<br />\r\nWe note that you have not yet completed the survey, and wish to remind you that the survey is still available should you wish to take part.<br />\r\n<br />\r\nThe survey is titled:<br />\r\n\"{SURVEYNAME}\"<br />\r\n<br />\r\n\"{SURVEYDESCRIPTION}\"<br />\r\n<br />\r\nTo participate, please click on the link below.<br />\r\n<br />\r\nSincerely,<br />\r\n<br />\r\n{ADMINNAME} ({ADMINEMAIL})<br />\r\n<br />\r\n----------------------------------------------<br />\r\nClick here to do the survey:<br />\r\n{SURVEYURL}<br />\r\n<br />\r\nIf you do not want to participate in this survey and don\'t want to receive any more invitations please click the following link:<br />\r\n{OPTOUTURL}</body>\r\n</html>\r\n','Survey registration confirmation','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>Dear {FIRSTNAME},<br />\r\n<br />\r\nYou, or someone using your email address, have registered to participate in an online survey titled {SURVEYNAME}.<br />\r\n<br />\r\nTo complete this survey, click on the following URL:<br />\r\n<br />\r\n{SURVEYURL}<br />\r\n<br />\r\nIf you have any questions about this survey, or if you did not register to participate and believe this email is in error, please contact {ADMINNAME} at {ADMINEMAIL}.</body>\r\n</html>\r\n','Confirmation of your participation in our survey','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>Dear {FIRSTNAME},<br />\r\n<br />\r\nthis email is to confirm that you have completed the survey titled {SURVEYNAME} and your response has been saved. Thank you for participating.<br />\r\n<br />\r\nIf you have any further questions about this email, please contact {ADMINNAME} on {ADMINEMAIL}.<br />\r\n<br />\r\nSincerely,<br />\r\n<br />\r\n{ADMINNAME}</body>\r\n</html>\r\n',9,NULL,'Response submission for survey {SURVEYNAME}','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>Hello,<br />\r\n<br />\r\nA new response was submitted for your survey \'{SURVEYNAME}\'.<br />\r\n<br />\r\nClick the following link to reload the survey:<br />\r\n{RELOADURL}<br />\r\n<br />\r\nClick the following link to see the individual response:<br />\r\n{VIEWRESPONSEURL}<br />\r\n<br />\r\nClick the following link to edit the individual response:<br />\r\n{EDITRESPONSEURL}<br />\r\n<br />\r\nView statistics by clicking here:<br />\r\n{STATISTICSURL}</body>\r\n</html>\r\n','Response submission for survey {SURVEYNAME} with results','<html>\r\n<head>\r\n	<title></title>\r\n</head>\r\n<body>Hello,<br />\r\n<br />\r\nA new response was submitted for your survey \'{SURVEYNAME}\'.<br />\r\n<br />\r\nClick the following link to reload the survey:<br />\r\n{RELOADURL}<br />\r\n<br />\r\nClick the following link to see the individual response:<br />\r\n{VIEWRESPONSEURL}<br />\r\n<br />\r\nClick the following link to edit the individual response:<br />\r\n{EDITRESPONSEURL}<br />\r\n<br />\r\nView statistics by clicking here:<br />\r\n{STATISTICSURL}<br />\r\n<br />\r\n<br />\r\nThe following answers were given by the participant:<br />\r\n{ANSWERTABLE}</body>\r\n</html>\r\n',0,'a:0:{}'),(572748,'en','Test Sruvey','','','','','','Invitation to participate in a survey','Dear {FIRSTNAME},<br />\n<br />\nyou have been invited to participate in a survey.<br />\n<br />\nThe survey is titled:<br />\n\"{SURVEYNAME}\"<br />\n<br />\n\"{SURVEYDESCRIPTION}\"<br />\n<br />\nTo participate, please click on the link below.<br />\n<br />\nSincerely,<br />\n<br />\n{ADMINNAME} ({ADMINEMAIL})<br />\n<br />\n----------------------------------------------<br />\nClick here to do the survey:<br />\n{S